'11': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0436\u0438\u0442\u043B\u043E\u0432\u0456"
'111': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u043E\u0434\u043D\u043E\u043A\u0432\u0430\u0440\u0442\u0438\u0440\u043D\u0456"
'1110': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u043E\u0434\u043D\u043E\u043A\u0432\u0430\u0440\u0442\u0438\u0440\u043D\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454: \u0432\u0456\u0434\u043E\u043A\u0440\u0435\u043C\u043B\u0435\u043D\u0456 \u0436\u0438\u0442\u043B\u043E\u0432\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0441\u0430\u0434\u0438\u0431\u043D\u043E\u0433\u043E \u0442\u0438\u043F\u0443 (\u043C\u0456\u0441\u044C\u043A\u0456, \u043F\u043E\u0437\u0430\u043C\u0456\u0441\u044C\u043A\u0456, \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u0456), \u0432\u0456\u043B\u043B\u0438, \u0434\u0430\u0447\u0456, \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0434\u043B\u044F \u043F\u0435\u0440\u0441\u043E\u043D\u0430\u043B\u0443 \u043B\u0456\u0441\u043E\u0432\u043E\u0433\u043E \u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u0442\u0432\u0430, \u043B\u0456\u0442\u043D\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0434\u043B\u044F \u0442\u0438\u043C\u0447\u0430\u0441\u043E\u0432\u043E\u0433\u043E \u043F\u0440\u043E\u0436\u0438\u0432\u0430\u043D\u043D\u044F, \u0441\u0430\u0434\u043E\u0432\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0442\u0430 \u0442. \u0456\u043D.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0441\u043F\u0430\u0440\u0435\u043D\u0456 \u0430\u0431\u043E \u0437\u0431\u043B\u043E\u043A\u043E\u0432\u0430\u043D\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0437 \u043E\u043A\u0440\u0435\u043C\u0438\u043C\u0438 \u043A\u0432\u0430\u0440\u0442\u0438\u0440\u0430\u043C\u0438, \u0449\u043E \u043C\u0430\u044E\u0442\u044C \u0441\u0432\u0456\u0439 \u0432\u043B\u0430\u0441\u043D\u0438\u0439 \u0432\u0445\u0456\u0434 \u0437 \u0432\u0443\u043B\u0438\u0446\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043D\u0435\u0436\u0438\u0442\u043B\u043E\u0432\u0456 \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 (12.71)"
'1110.1': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u043E\u0434\u043D\u043E\u043A\u0432\u0430\u0440\u0442\u0438\u0440\u043D\u0456 \u043C\u0430\u0441\u043E\u0432\u043E\u0457 \u0437\u0430\u0431\u0443\u0434\u043E\u0432\u0438"
'1110.2': "\u041A\u043E\u0442\u0435\u0434\u0436\u0456 \u0442\u0430 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u043E\u0434\u043D\u043E\u043A\u0432\u0430\u0440\u0442\u0438\u0440\u043D\u0456 \u043F\u0456\u0434\u0432\u0438\u0449\u0435\u043D\u043E\u0457 \u043A\u043E\u043C\u0444\u043E\u0440\u0442\u043D\u043E\u0441\u0442\u0456"
'1110.3': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u0441\u0430\u0434\u0438\u0431\u043D\u043E\u0433\u043E \u0442\u0438\u043F\u0443"
'1110.4': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u0434\u0430\u0447\u043D\u0456 \u0442\u0430 \u0441\u0430\u0434\u043E\u0432\u0456"
'112': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u0437 \u0434\u0432\u043E\u043C\u0430 \u0442\u0430 \u0431\u0456\u043B\u044C\u0448\u0435 \u043A\u0432\u0430\u0440\u0442\u0438\u0440\u0430\u043C\u0438"
'1121': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u0437 \u0434\u0432\u043E\u043C\u0430 \u043A\u0432\u0430\u0440\u0442\u0438\u0440\u0430\u043C\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0432\u0456\u0434\u043E\u043A\u0440\u0435\u043C\u043B\u0435\u043D\u0456, \u0441\u043F\u0430\u0440\u0435\u043D\u0456 \u0430\u0431\u043E \u0437\u0431\u043B\u043E\u043A\u043E\u0432\u0430\u043D\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0437 \u0434\u0432\u043E\u043C\u0430 \u043A\u0432\u0430\u0440\u0442\u0438\u0440\u0430\u043C\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0441\u043F\u0430\u0440\u0435\u043D\u0456 \u0430\u0431\u043E \u0437\u0431\u043B\u043E\u043A\u043E\u0432\u0430\u043D\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0437 \u043E\u043A\u0440\u0435\u043C\u0438\u043C\u0438 \u043A\u0432\u0430\u0440\u0442\u0438\u0440\u0430\u043C\u0438, \u0449\u043E \u043C\u0430\u044E\u0442\u044C \u0441\u0432\u0456\u0439 \u0432\u043B\u0430\u0441\u043D\u0438\u0439 \u0432\u0445\u0456\u0434 \u0437 \u0432\u0443\u043B\u0438\u0446\u0456 (11.10)"
'1121.1': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u0434\u0432\u043E\u043A\u0432\u0430\u0440\u0442\u0438\u0440\u043D\u0456 \u043C\u0430\u0441\u043E\u0432\u043E\u0457 \u0437\u0430\u0431\u0443\u0434\u043E\u0432\u0438"
'1121.2': "\u041A\u043E\u0442\u0435\u0434\u0436\u0456 \u0442\u0430 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0434\u0432\u043E\u043A\u0432\u0430\u0440\u0442\u0438\u0440\u043D\u0456 \u043F\u0456\u0434\u0432\u0438\u0449\u0435\u043D\u043E\u0457 \u043A\u043E\u043C\u0444\u043E\u0440\u0442\u043D\u043E\u0441\u0442\u0456"
'1122': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u0437 \u0442\u0440\u044C\u043E\u043C\u0430 \u0442\u0430 \u0431\u0456\u043B\u044C\u0448\u0435 \u043A\u0432\u0430\u0440\u0442\u0438\u0440\u0430\u043C\u0438. \u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0456\u043D\u0448\u0456 \u0436\u0438\u0442\u043B\u043E\u0432\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0437 \u0442\u0440\u044C\u043E\u043C\u0430 \u0442\u0430 \u0431\u0456\u043B\u044C\u0448\u0435 \u043A\u0432\u0430\u0440\u0442\u0438\u0440\u0430\u043C\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0433\u0443\u0440\u0442\u043E\u0436\u0438\u0442\u043A\u0438 (11.30)\u0433\u043E\u0442\u0435\u043B\u0456 (12.11)\u0442\u0443\u0440\u0438\u0441\u0442\u0438\u0447\u043D\u0456 \u0431\u0430\u0437\u0438, \u0442\u0430\u0431\u043E\u0440\u0438 \u0442\u0430 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443 (12.12)"
'1122.1': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u0431\u0430\u0433\u0430\u0442\u043E\u043A\u0432\u0430\u0440\u0442\u0438\u0440\u043D\u0456 \u043C\u0430\u0441\u043E\u0432\u043E\u0457 \u0437\u0430\u0431\u0443\u0434\u043E\u0432\u0438"
'1122.2': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u0431\u0430\u0433\u0430\u0442\u043E\u043A\u0432\u0430\u0440\u0442\u0438\u0440\u043D\u0456 \u043F\u0456\u0434\u0432\u0438\u0449\u0435\u043D\u043E\u0457 \u043A\u043E\u043C\u0444\u043E\u0440\u0442\u043D\u043E\u0441\u0442\u0456, \u0456\u043D\u0434\u0438\u0432\u0456\u0434\u0443\u0430\u043B\u044C\u043D\u0456"
'1122.3': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u0436\u0438\u0442\u043B\u043E\u0432\u0456 \u0433\u043E\u0442\u0435\u043B\u044C\u043D\u043E\u0433\u043E \u0442\u0438\u043F\u0443"
'113': "\u0413\u0443\u0440\u0442\u043E\u0436\u0438\u0442\u043A\u0438"
'1130': "\u0413\u0443\u0440\u0442\u043E\u0436\u0438\u0442\u043A\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0436\u0438\u0442\u043B\u043E\u0432\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0434\u043B\u044F \u043A\u043E\u043B\u0435\u043A\u0442\u0438\u0432\u043D\u043E\u0433\u043E \u043F\u0440\u043E\u0436\u0438\u0432\u0430\u043D\u043D\u044F, \u0432\u043A\u043B\u044E\u0447\u0430\u044E\u0447\u0438 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0434\u043B\u044F \u043B\u044E\u0434\u0435\u0439 \u043F\u043E\u0445\u0438\u043B\u043E\u0433\u043E \u0432\u0456\u043A\u0443 \u0442\u0430 \u0456\u043D\u0432\u0430\u043B\u0456\u0434\u0456\u0432, \u0441\u0442\u0443\u0434\u0435\u043D\u0442\u0456\u0432, \u0434\u0456\u0442\u0435\u0439 \u0442\u0430 \u0456\u043D\u0448\u0438\u0445 \u0441\u043E\u0446\u0456\u0430\u043B\u044C\u043D\u0438\u0445 \u0433\u0440\u0443\u043F, \u043D\u0430\u043F\u0440\u0438\u043A\u043B\u0430\u0434, \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0434\u043B\u044F \u0431\u0456\u0436\u0435\u043D\u0446\u0456\u0432, \u0433\u0443\u0440\u0442\u043E\u0436\u0438\u0442\u043A\u0438 \u0434\u043B\u044F \u0440\u043E\u0431\u0456\u0442\u043D\u0438\u043A\u0456\u0432 \u0442\u0430 \u0441\u043B\u0443\u0436\u0431\u043E\u0432\u0446\u0456\u0432, \u0433\u0443\u0440\u0442\u043E\u0436\u0438\u0442\u043A\u0438 \u0434\u043B\u044F \u0441\u0442\u0443\u0434\u0435\u043D\u0442\u0456\u0432 \u0442\u0430 \u0443\u0447\u043D\u0456\u0432 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432, \u0441\u0438\u0440\u0456\u0442\u0441\u044C\u043A\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438, \u043F\u0440\u0438\u0442\u0443\u043B\u043A\u0438 \u0434\u043B\u044F \u0431\u0435\u0437\u0434\u043E\u043C\u043D\u0438\u0445 \u0442\u0430 \u0442. \u0456\u043D.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043B\u0456\u043A\u0430\u0440\u043D\u0456, \u043A\u043B\u0456\u043D\u0456\u043A\u0438 (12.64)\u0432'\u044F\u0437\u043D\u0438\u0446\u0456, \u043A\u0430\u0437\u0430\u0440\u043C\u0438 (12.74)"
'1130.1': "\u0413\u0443\u0440\u0442\u043E\u0436\u0438\u0442\u043A\u0438 \u0434\u043B\u044F \u0440\u043E\u0431\u0456\u0442\u043D\u0438\u043A\u0456\u0432 \u0442\u0430 \u0441\u043B\u0443\u0436\u0431\u043E\u0432\u0446\u0456\u0432"
'1130.2': "\u0413\u0443\u0440\u0442\u043E\u0436\u0438\u0442\u043A\u0438 \u0434\u043B\u044F \u0441\u0442\u0443\u0434\u0435\u043D\u0442\u0456\u0432 \u0432\u0438\u0449\u0438\u0445 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432"
'1130.3': "\u0413\u0443\u0440\u0442\u043E\u0436\u0438\u0442\u043A\u0438 \u0434\u043B\u044F \u0443\u0447\u043D\u0456\u0432 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432"
'1130.4': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438-\u0456\u043D\u0442\u0435\u0440\u043D\u0430\u0442\u0438 \u0434\u043B\u044F \u043B\u044E\u0434\u0435\u0439 \u043F\u043E\u0445\u0438\u043B\u043E\u0433\u043E \u0432\u0456\u043A\u0443 \u0442\u0430 \u0456\u043D\u0432\u0430\u043B\u0456\u0434\u0456\u0432"
'1130.5': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u0434\u0438\u0442\u0438\u043D\u0438 \u0442\u0430 \u0441\u0438\u0440\u0456\u0442\u0441\u044C\u043A\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438"
'1130.6': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u0434\u043B\u044F \u0431\u0456\u0436\u0435\u043D\u0446\u0456\u0432, \u043F\u0440\u0438\u0442\u0443\u043B\u043A\u0438 \u0434\u043B\u044F \u0431\u0435\u0437\u0434\u043E\u043C\u043D\u0438\u0445"
'1130.9': "\u0411\u0443\u0434\u0438\u043D\u043A\u0438 \u0434\u043B\u044F \u043A\u043E\u043B\u0435\u043A\u0442\u0438\u0432\u043D\u043E\u0433\u043E \u043F\u0440\u043E\u0436\u0438\u0432\u0430\u043D\u043D\u044F \u0456\u043D\u0448\u0456"
'12': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043D\u0435\u0436\u0438\u0442\u043B\u043E\u0432\u0456"
'121': "\u0413\u043E\u0442\u0435\u043B\u0456, \u0440\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u0438 \u0442\u0430 \u043F\u043E\u0434\u0456\u0431\u043D\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456"
'1211': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0433\u043E\u0442\u0435\u043B\u044C\u043D\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0433\u043E\u0442\u0435\u043B\u0456, \u043C\u043E\u0442\u0435\u043B\u0456, \u043A\u0435\u043C\u043F\u0456\u043D\u0433\u0438, \u043F\u0430\u0441\u0456\u043E\u043D\u0430\u0442\u0438 \u0442\u0430 \u043F\u043E\u0434\u0456\u0431\u043D\u0456 \u0437\u0430\u043A\u043B\u0430\u0434\u0438 \u0437 \u043D\u0430\u0434\u0430\u043D\u043D\u044F \u0436\u0438\u0442\u043B\u0430 \u0437 \u0440\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u043E\u043C \u0430\u0431\u043E \u0431\u0435\u0437 \u043D\u044C\u043E\u0433\u043E.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043E\u043A\u0440\u0435\u043C\u0456 \u0440\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u0438 \u0442\u0430 \u0431\u0430\u0440\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0440\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u0438 \u0432 \u0436\u0438\u0442\u043B\u043E\u0432\u0438\u0445 \u0431\u0443\u0434\u0438\u043D\u043A\u0430\u0445 (11.22)\u0442\u0443\u0440\u0438\u0441\u0442\u0438\u0447\u043D\u0456 \u0431\u0430\u0437\u0438, \u0433\u0456\u0440\u0441\u044C\u043A\u0456 \u043F\u0440\u0438\u0442\u0443\u043B\u043A\u0438, \u0442\u0430\u0431\u043E\u0440\u0438 \u0434\u043B\u044F \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443, \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443 (12.12)\u0440\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u0438 \u0432 \u0442\u043E\u0440\u0433\u043E\u0432\u0438\u0445 \u0446\u0435\u043D\u0442\u0440\u0430\u0445 (12.30)"
'1211.1': "\u0413\u043E\u0442\u0435\u043B\u0456"
'1211.2': "\u041C\u043E\u0442\u0435\u043B\u0456"
'1211.3': "\u041A\u0435\u043C\u043F\u0456\u043D\u0433\u0438"
'1211.4': "\u041F\u0430\u043D\u0441\u0456\u043E\u043D\u0430\u0442\u0438"
'1211.5': "\u0420\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u0438 \u0442\u0430 \u0431\u0430\u0440\u0438"
'1212': "\u0406\u043D\u0448\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u0442\u0438\u043C\u0447\u0430\u0441\u043E\u0432\u043E\u0433\u043E \u043F\u0440\u043E\u0436\u0438\u0432\u0430\u043D\u043D\u044F.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0442\u0443\u0440\u0438\u0441\u0442\u0438\u0447\u043D\u0456 \u0431\u0430\u0437\u0438, \u0433\u0456\u0440\u0441\u044C\u043A\u0456 \u043F\u0440\u0438\u0442\u0443\u043B\u043A\u0438, \u0434\u0438\u0442\u044F\u0447\u0456 \u0442\u0430 \u0441\u0456\u043C\u0435\u0439\u043D\u0456 \u0442\u0430\u0431\u043E\u0440\u0438 \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443, \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443 \u0442\u0430 \u0456\u043D\u0448\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u0442\u0438\u043C\u0447\u0430\u0441\u043E\u0432\u043E\u0433\u043E \u043F\u0440\u043E\u0436\u0438\u0432\u0430\u043D\u043D\u044F, \u043D\u0435 \u043A\u043B\u0430\u0441\u0438\u0444\u0456\u043A\u043E\u0432\u0430\u043D\u0456 \u0440\u0430\u043D\u0456\u0448\u0435.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0433\u043E\u0442\u0435\u043B\u0456 \u0442\u0430 \u043F\u043E\u0434\u0456\u0431\u043D\u0456 \u0437\u0430\u043A\u043B\u0430\u0434\u0438 \u0437 \u043D\u0430\u0434\u0430\u043D\u043D\u044F \u0436\u0438\u0442\u043B\u0430 (12.11)\u043F\u0430\u0440\u043A\u0438 \u0434\u043B\u044F \u0434\u043E\u0437\u0432\u0456\u043B\u043B\u044F \u0442\u0430 \u0440\u043E\u0437\u0432\u0430\u0433 (24.12)"
'1212.1': "\u0422\u0443\u0440\u0438\u0441\u0442\u0438\u0447\u043D\u0456 \u0431\u0430\u0437\u0438 \u0442\u0430 \u0433\u0456\u0440\u0441\u044C\u043A\u0456 \u043F\u0440\u0438\u0442\u0443\u043B\u043A\u0438"
'1212.2': "\u0414\u0438\u0442\u044F\u0447\u0456 \u0442\u0430 \u0441\u0456\u043C\u0435\u0439\u043D\u0456 \u0442\u0430\u0431\u043E\u0440\u0438 \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443"
'1212.3': "\u0426\u0435\u043D\u0442\u0440\u0438 \u0442\u0430 \u0431\u0443\u0434\u0438\u043D\u043A\u0438 \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443"
'1212.9': "\u0406\u043D\u0448\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u0442\u0438\u043C\u0447\u0430\u0441\u043E\u0432\u043E\u0433\u043E \u043F\u0440\u043E\u0436\u0438\u0432\u0430\u043D\u043D\u044F, \u043D\u0435 \u043A\u043B\u0430\u0441\u0438\u0444\u0456\u043A\u043E\u0432\u0430\u043D\u0456 \u0440\u0430\u043D\u0456\u0448\u0435"
'122': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043E\u0444\u0456\u0441\u043D\u0456"
'1220': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043E\u0444\u0456\u0441\u043D\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0431\u0443\u0434\u0456\u0432\u043B\u0456, \u0449\u043E \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F \u044F\u043A \u043F\u0440\u0438\u043C\u0456\u0449\u0435\u043D\u043D\u044F \u0434\u043B\u044F \u043A\u043E\u043D\u0442\u043E\u0440\u0441\u044C\u043A\u0438\u0445 \u0442\u0430 \u0430\u0434\u043C\u0456\u043D\u0456\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043D\u0438\u0445 \u0446\u0456\u043B\u0435\u0439, \u0432 \u0442\u043E\u043C\u0443 \u0447\u0438\u0441\u043B\u0456 \u0434\u043B\u044F \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0438\u0445 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432, \u0431\u0430\u043D\u043A\u0456\u0432, \u043F\u043E\u0448\u0442\u043E\u0432\u0438\u0445 \u0432\u0456\u0434\u0434\u0456\u043B\u0435\u043D\u044C, \u043E\u0440\u0433\u0430\u043D\u0456\u0432 \u043C\u0456\u0441\u0446\u0435\u0432\u043E\u0433\u043E \u0443\u043F\u0440\u0430\u0432\u043B\u0456\u043D\u043D\u044F, \u0443\u0440\u044F\u0434\u043E\u0432\u0438\u0445 \u0442\u0430 \u0432\u0456\u0434\u043E\u043C\u0447\u0438\u0445 \u0434\u0435\u043F\u0430\u0440\u0442\u0430\u043C\u0435\u043D\u0442\u0456\u0432 \u0442\u0430 \u0442. \u0456\u043D.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0446\u0435\u043D\u0442\u0440\u0438 \u0434\u043B\u044F \u0437'\u0457\u0437\u0434\u0456\u0432 \u0442\u0430 \u043A\u043E\u043D\u0444\u0435\u0440\u0435\u043D\u0446\u0456\u0439, \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u043E\u0440\u0433\u0430\u043D\u0456\u0432 \u043F\u0440\u0430\u0432\u043E\u0441\u0443\u0434\u0434\u044F, \u043F\u0430\u0440\u043B\u0430\u043C\u0435\u043D\u0442\u0441\u044C\u043A\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043E\u0444\u0456\u0441\u0438 \u0432 \u0431\u0443\u0434\u0456\u0432\u043B\u044F\u0445, \u0449\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u0456 (\u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F), \u0433\u043E\u043B\u043E\u0432\u043D\u0438\u043C \u0447\u0438\u043D\u043E\u043C, \u0434\u043B\u044F \u0456\u043D\u0448\u0438\u0445 \u0446\u0456\u043B\u0435\u0439"
'1220.1': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043E\u0440\u0433\u0430\u043D\u0456\u0432 \u0434\u0435\u0440\u0436\u0430\u0432\u043D\u043E\u0433\u043E \u0442\u0430 \u043C\u0456\u0441\u0446\u0435\u0432\u043E\u0433\u043E \u0443\u043F\u0440\u0430\u0432\u043B\u0456\u043D\u043D\u044F"
'1220.2': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0444\u0456\u043D\u0430\u043D\u0441\u043E\u0432\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F"
'1220.3': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043E\u0440\u0433\u0430\u043D\u0456\u0432 \u043F\u0440\u0430\u0432\u043E\u0441\u0443\u0434\u0434\u044F"
'1220.4': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0437\u0430\u043A\u043E\u0440\u0434\u043E\u043D\u043D\u0438\u0445 \u043F\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043D\u0438\u0446\u0442\u0432"
'1220.5': "\u0410\u0434\u043C\u0456\u043D\u0456\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043D\u043E-\u043F\u043E\u0431\u0443\u0442\u043E\u0432\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0438\u0445 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432"
'1220.9': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u043A\u043E\u043D\u0442\u043E\u0440\u0441\u044C\u043A\u0438\u0445 \u0442\u0430 \u0430\u0434\u043C\u0456\u043D\u0456\u0441\u0442\u0440\u0430\u0442\u0438\u0432\u043D\u0438\u0445 \u0446\u0456\u043B\u0435\u0439 \u0456\u043D\u0448\u0456"
'123': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0442\u043E\u0440\u0433\u043E\u0432\u0435\u043B\u044C\u043D\u0456"
'1230': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0442\u043E\u0440\u0433\u043E\u0432\u0435\u043B\u044C\u043D\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0442\u043E\u0440\u0433\u043E\u0432\u0456 \u0446\u0435\u043D\u0442\u0440\u0438, \u043F\u0430\u0441\u0430\u0436\u0456, \u0443\u043D\u0456\u0432\u0435\u0440\u043C\u0430\u0433\u0438, \u0441\u043F\u0435\u0446\u0456\u0430\u043B\u0456\u0437\u043E\u0432\u0430\u043D\u0456 \u043C\u0430\u0433\u0430\u0437\u0438\u043D\u0438 \u0442\u0430 \u043F\u0430\u0432\u0456\u043B\u044C\u0439\u043E\u043D\u0438, \u0437\u0430\u043B\u0438 \u0434\u043B\u044F \u044F\u0440\u043C\u0430\u0440\u043A\u0456\u0432, \u0430\u0443\u043A\u0446\u0456\u043E\u043D\u0456\u0432, \u0432\u0438\u0441\u0442\u0430\u0432\u043E\u043A, \u043A\u0440\u0438\u0442\u0456 \u0440\u0438\u043D\u043A\u0438, \u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0442\u0435\u0445\u043D\u0456\u0447\u043D\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u0432\u0456 \u0442\u0430 \u0442. \u0456\u043D.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432\u0430 \u0442\u0430 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u0438 \u0433\u0440\u043E\u043C\u0430\u0434\u0441\u044C\u043A\u043E\u0433\u043E \u0445\u0430\u0440\u0447\u0443\u0432\u0430\u043D\u043D\u044F (\u0457\u0434\u0430\u043B\u044C\u043D\u0456, \u043A\u0430\u0444\u0435, \u0437\u0430\u043A\u0443\u0441\u043E\u0447\u043D\u0456 \u0442\u0430 \u0442. \u0456\u043D.)\u043F\u0440\u0438\u043C\u0456\u0449\u0435\u043D\u043D\u044F \u0441\u043A\u043B\u0430\u0434\u0441\u044C\u043A\u0456 \u0442\u0430 \u0431\u0430\u0437\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0442\u043E\u0440\u0433\u0456\u0432\u043B\u0456 \u0439 \u0433\u0440\u043E\u043C\u0430\u0434\u0441\u044C\u043A\u043E\u0433\u043E \u0445\u0430\u0432\u0440\u0447\u0443\u0432\u0430\u043D\u043D\u044F\u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0442\u0441\u0432\u0430 \u043F\u043E\u0431\u0443\u0442\u043E\u0432\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043D\u0435\u0432\u0435\u043B\u0438\u043A\u0456 \u043C\u0430\u0433\u0430\u0437\
  \u0438\u043D\u0438 \u0432 \u0431\u0443\u0434\u0456\u0432\u043B\u044F\u0445, \u0449\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u0456 (\u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F), \u0433\u043E\u043B\u043E\u0432\u043D\u0438\u043C \u0447\u0438\u043D\u043E\u043C, \u0434\u043B\u044F \u0456\u043D\u0448\u0438\u0445 \u0446\u0456\u043B\u0435\u0439\u0440\u0435\u0441\u0442\u043E\u0440\u0430\u043D\u0438 \u0442\u0430 \u0431\u0430\u0440\u0438, \u0440\u043E\u0437\u043C\u0456\u0449\u0435\u043D\u0456 \u0432 \u0433\u043E\u0442\u0435\u043B\u044F\u0445 \u0430\u0431\u043E \u043E\u043A\u0440\u0435\u043C\u043E (12.11)\u043B\u0430\u0437\u043D\u0456 \u0442\u0430 \u043F\u0440\u0430\u043B\u044C\u043D\u0456 (12.74)"
'1230.1': "\u0422\u043E\u0440\u0433\u043E\u0432\u0456 \u0446\u0435\u043D\u0442\u0440\u0438, \u0443\u043D\u0456\u0432\u0435\u0440\u043C\u0430\u0433\u0438, \u043C\u0430\u0433\u0430\u0437\u0438\u043D\u0438"
'1230.2': "\u041A\u0440\u0438\u0442\u0456 \u0440\u0438\u043D\u043A\u0438, \u043F\u0430\u0432\u0456\u043B\u044C\u0439\u043E\u043D\u0438 \u0442\u0430 \u0437\u0430\u043B\u0438 \u0434\u043B\u044F \u044F\u0440\u043C\u0430\u0440\u043A\u0456\u0432"
'1230.3': "\u0421\u0442\u0430\u043D\u0446\u0456\u0457 \u0442\u0435\u0445\u043D\u0456\u0447\u043D\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u0456\u0432"
'1230.4': "\u0407\u0434\u0430\u043B\u044C\u043D\u0456, \u043A\u0430\u0444\u0435, \u0437\u0430\u043A\u0443\u0441\u043E\u0447\u043D\u0456 \u0442\u0430 \u0442. \u0456\u043D"
'1230.5': "\u0411\u0430\u0437\u0438 \u0442\u0430 \u0441\u043A\u043B\u0430\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0442\u043E\u0440\u0433\u0456\u0432\u043B\u0456 \u0439 \u0433\u0440\u043E\u043C\u0430\u0434\u0441\u044C\u043A\u043E\u0433\u043E \u0445\u0430\u0440\u0447\u0443\u0432\u0430\u043D\u043D\u044F"
'1230.6': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043F\u043E\u0431\u0443\u0442\u043E\u0432\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F"
'1230.9': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0442\u043E\u0440\u0433\u043E\u0432\u0435\u043B\u044C\u043D\u0456 \u0456\u043D\u0448\u0456"
'124': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443 \u0442\u0430 \u0437\u0430\u0441\u043E\u0431\u0456\u0432 \u0437\u0432'\u044F\u0437\u043A\u0443"
'1241': "\u0412\u043E\u043A\u0437\u0430\u043B\u0438, \u0430\u0435\u0440\u043E\u0432\u043E\u043A\u0437\u0430\u043B\u0438, \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0437\u0430\u0441\u043E\u0431\u0456\u0432 \u0437\u0432'\u044F\u0437\u043A\u0443 \u0442\u0430 \u043F\u043E\u0432'\u044F\u0437\u0430\u043D\u0456 \u0437 \u043D\u0438\u043C\u0438 \u0431\u0443\u0434\u0456\u0432\u043B\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0446\u0438\u0432\u0456\u043B\u044C\u043D\u0438\u0445 \u0442\u0430 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0438\u0445 \u0430\u0435\u0440\u043E\u043F\u043E\u0440\u0442\u0456\u0432, \u043C\u0456\u0441\u044C\u043A\u043E\u0433\u043E \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443, \u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0438\u0445 \u0441\u0442\u0430\u043D\u0446\u0456\u0439, \u0430\u0432\u0442\u043E\u0431\u0443\u0441\u043D\u0438\u0445 \u0441\u0442\u0430\u043D\u0446\u0456\u0439, \u043C\u043E\u0440\u0441\u044C\u043A\u0438\u0445 \u0442\u0430 \u0440\u0456\u0447\u043A\u043E\u0432\u0438\u0445 \u0432\u043E\u043A\u0437\u0430\u043B\u0456\u0432, \u0444\u0443\u043D\u0456\u043A\u0443\u043B\u0435\u0440\u043D\u0438\u0445 \u0442\u0430 \u043F\u0456\u0434\u0456\u0439\u043C\u0430\u043B\u044C\u043D\u0438\u0445 \u0441\u0442\u0430\u043D\u0446\u0456\u0439 \u043A\u0430\u043D\u0430\u0442\u043D\u0438\u0445 \u0434\u043E\u0440\u0456\u0433\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0446\u0435\u043D\u0442\u0440\u0456\u0432 \u0440\u0430\u0434\u0456\u043E- \u0442\u0430 \u0442\u0435\u043B\u0435\u0432\u0456\u0437\u0456\u0439\u043D\u043E\u0433\u043E \u043C\u043E\u0432\u043B\u0435\u043D\u043D\u044F, \u0442\u0435\u043B\u0435\u0444\u043E\u043D\u043D\u0438\u0445 \u0441\u0442\u0430\u043D\u0446\u0456\u0439, \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439\u043D\u0438\u0445 \u0446\u0435\u043D\u0442\u0440\u0456\u0432 \u0442\u0430 \u0442. \u0456\u043D.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0430\u043D\u0433\u0430\u0440\u0438 \u0434\u043B\u044F \u043B\u0456\u0442\u0430\u043A\u0456\u0432, \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0438\u0445 \u0431\u043B\u043E\u043A\u043F\u043E\u0441\u0442\u0456\u0432, \u043B\u043E\u043A\u043E\u043C\u043E\u0442\u0438\
  \u0432\u043D\u0456 \u0442\u0430 \u0432\u0430\u0433\u043E\u043D\u043D\u0456 \u0434\u0435\u043F\u043E, \u0442\u0440\u0430\u043C\u0432\u0430\u0439\u043D\u0456 \u0442\u0430 \u0442\u0440\u043E\u043B\u0435\u0439\u0431\u0443\u0441\u043D\u0456 \u0434\u0435\u043F\u043E\u0442\u0435\u043B\u0435\u0444\u043E\u043D\u043D\u0456 \u043A\u0456\u043E\u0441\u043A\u0438\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u043C\u0430\u044F\u043A\u0456\u0432\u0434\u0438\u0441\u043F\u0435\u0442\u0447\u0435\u0440\u0441\u044C\u043A\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u043E\u0432\u0456\u0442\u0440\u044F\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0442\u0435\u0445\u043D\u0456\u0447\u043D\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u0456\u0432 (12.30)\u0440\u0435\u0437\u0435\u0440\u0432\u0443\u0430\u0440\u0438, \u0441\u0438\u043B\u043E\u0441\u0438 \u0442\u0430 \u0442\u043E\u0432\u0430\u0440\u043D\u0456 \u0441\u043A\u043B\u0430\u0434\u0438 (12.52)\u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0456 \u043A\u043E\u043B\u0456\u0457 (21.21, 21.22)\u0437\u043B\u0456\u0442\u043D\u043E-\u043F\u043E\u0441\u0430\u0434\u043A\u043E\u0432\u0456 \u0441\u043C\u0443\u0433\u0438 \u0430\u0435\u0440\u043E\u0434\u0440\u043E\u043C\u0456\u0432 (21.30)\u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439\u043D\u0456 \u043B\u0456\u043D\u0456\u0457 \u0442\u0430 \u0449\u043E\u0433\u043B\u0438 (22.13, 22.24)\u043D\u0430\u0444\u0442\u043E\u0442\u0435\u0440\u043C\u0456\u043D\u0430\u043B\u0438 (23.03)"
'1241.1': "\u0410\u0432\u0442\u043E\u0432\u043E\u043A\u0437\u0430\u043B\u0438 \u0442\u0430 \u0456\u043D\u0448\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
'1241.2': "\u0412\u043E\u043A\u0437\u0430\u043B\u0438 \u0442\u0430 \u0456\u043D\u0448\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
'1241.3': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043C\u0456\u0441\u044C\u043A\u043E\u0433\u043E \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
'1241.4': "\u0410\u0435\u0440\u043E\u0432\u043E\u043A\u0437\u0430\u043B\u0438 \u0442\u0430 \u0456\u043D\u0448\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u043E\u0432\u0456\u0442\u0440\u044F\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443"
'1241.5': "\u041C\u043E\u0440\u0441\u044C\u043A\u0456 \u0442\u0430 \u0440\u0456\u0447\u043A\u043E\u0432\u0456 \u0432\u043E\u043A\u0437\u0430\u043B\u0438, \u043C\u0430\u044F\u043A\u0438 \u0442\u0430 \u043F\u043E\u0432'\u044F\u0437\u0430\u043D\u0456 \u0437 \u043D\u0438\u043C\u0438 \u0431\u0443\u0434\u0456\u0432\u043B\u0456"
'1241.6': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0441\u0442\u0430\u043D\u0446\u0456\u0439 \u043F\u0456\u0434\u0432\u0456\u0441\u043D\u0438\u0445 \u0442\u0430 \u043A\u0430\u043D\u0430\u0442\u043D\u0438\u0445 \u0434\u043E\u0440\u0456\u0433"
'1241.7': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0446\u0435\u043D\u0442\u0440\u0456\u0432 \u0440\u0430\u0434\u0456\u043E- \u0442\u0430 \u0442\u0435\u043B\u0435\u0432\u0456\u0437\u0456\u0439\u043D\u043E\u0433\u043E \u043C\u043E\u0432\u043B\u0435\u043D\u043D\u044F, \u0442\u0435\u043B\u0435\u0444\u043E\u043D\u043D\u0438\u0445 \u0441\u0442\u0430\u043D\u0446\u0456\u0439, \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439\u043D\u0438\u0445 \u0446\u0435\u043D\u0442\u0440\u0456\u0432 \u0442\u0430 \u0442. \u0456\u043D"
'1241.8': "\u0410\u043D\u0433\u0430\u0440\u0438 \u0434\u043B\u044F \u043B\u0456\u0442\u0430\u043A\u0456\u0432, \u043B\u043E\u043A\u043E\u043C\u043E\u0442\u0438\u0432\u043D\u0456, \u0432\u0430\u0433\u043E\u043D\u043D\u0456, \u0442\u0440\u0430\u043C\u0432\u0430\u0439\u043D\u0456 \u0442\u0430 \u0442\u0440\u043E\u043B\u0435\u0439\u0431\u0443\u0441\u043D\u0456 \u0434\u0435\u043F\u043E"
'1241.9': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443 \u0442\u0430 \u0437\u0430\u0441\u043E\u0431\u0456\u0432 \u0437\u0432'\u044F\u0437\u043A\u0443 \u0456\u043D\u0448\u0456"
'1242': "\u0413\u0430\u0440\u0430\u0436\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0433\u0430\u0440\u0430\u0436\u0456 (\u043D\u0430\u0437\u0435\u043C\u043D\u0456 \u0439 \u043F\u0456\u0434\u0437\u0435\u043C\u043D\u0456) \u0442\u0430 \u043A\u0440\u0438\u0442\u0456 \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u0456 \u0441\u0442\u043E\u044F\u043D\u043A\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043D\u0430\u0432\u0456\u0441\u0438 \u0434\u043B\u044F \u0432\u0435\u043B\u043E\u0441\u0438\u043F\u0435\u0434\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0430\u0432\u0442\u043E\u0441\u0442\u043E\u044F\u043D\u043A\u0438 \u0432 \u0431\u0443\u0434\u0456\u0432\u043B\u044F\u0445, \u0449\u043E \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F, \u0433\u043E\u043B\u043E\u0432\u043D\u0438\u043C \u0447\u0438\u043D\u043E\u043C, \u0434\u043B\u044F \u0456\u043D\u0448\u0438\u0445 \u0446\u0456\u043B\u0435\u0439\u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0442\u0435\u0445\u043D\u0456\u0447\u043D\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u0456\u0432 (12.30)"
'1242.1': "\u0413\u0430\u0440\u0430\u0436\u0456 \u043D\u0430\u0437\u0435\u043C\u043D\u0456"
'1242.2': "\u0413\u0430\u0440\u0430\u0436\u0456 \u043F\u0456\u0434\u0437\u0435\u043C\u043D\u0456"
'1242.3': "\u0421\u0442\u043E\u044F\u043D\u043A\u0438 \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u0456 \u043A\u0440\u0438\u0442\u0456"
'1242.4': "\u041D\u0430\u0432\u0456\u0441\u0438 \u0434\u043B\u044F \u0432\u0435\u043B\u043E\u0441\u0438\u043F\u0435\u0434\u0456\u0432"
'125': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0456 \u0442\u0430 \u0441\u043A\u043B\u0430\u0434\u0438"
'1251': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043A\u0440\u0438\u0442\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0433\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F, \u043D\u0430\u043F\u0440\u0438\u043A\u043B\u0430\u0434, \u0444\u0430\u0431\u0440\u0438\u043A\u0438, \u043C\u0430\u0439\u0441\u0442\u0435\u0440\u043D\u0456, \u0431\u043E\u0439\u043D\u0456, \u043F\u0438\u0432\u043E\u0432\u0430\u0440\u043D\u0456 \u0437\u0430\u0432\u043E\u0434\u0456, \u0441\u043A\u043B\u0430\u0434\u0430\u043B\u044C\u043D\u0456 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432\u0430 \u0442\u0430 \u0442. \u0456\u043D. \u0437\u0430 \u0457\u0445 \u0444\u0443\u043D\u043A\u0446\u0456\u043E\u043D\u0438\u043B\u044C\u043D\u0438\u043C \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F\u043C.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0440\u0435\u0437\u0435\u0440\u0432\u0443\u0430\u0440\u0438, \u0441\u0438\u043B\u043E\u0441\u0438 \u0442\u0430 \u0441\u043A\u043B\u0430\u0434\u0438 (12.52)\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u043E\u0433\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F (12.71)\u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u043D\u0456 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 (\u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0456\u0457, \u043D\u0430\u0444\u0442\u043E\u043F\u0435\u0440\u0435\u0440\u043E\u0431\u043D\u0456 \u0437\u0430\u0432\u043E\u0434\u0438 \u0442\u0430 \u0442. \u0456\u043D.), \u044F\u043A\u0456 \u043D\u0435 \u043C\u0430\u044E\u0442\u044C \u0445\u0430\u0440\u0430\u043A\u0442\u0435\u0440\u0438\u0441\u0442\u0438\u043A \u0431\u0443\u0434\u0456\u0432\u0435\u043B\u044C (23.0)"
'1251.1': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043C\u0430\u0448\u0438\u043D\u043E\u0431\u0443\u0434\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u043C\u0435\u0442\u0430\u043B\u043E\u043E\u0431\u0440\u043E\u0431\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
'1251.2': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0447\u043E\u0440\u043D\u043E\u0457 \u043C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u0457"
'1251.3': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0445\u0456\u043C\u0456\u0447\u043D\u043E\u0457 \u0442\u0430 \u043D\u0430\u0444\u0442\u043E\u0445\u0456\u043C\u0456\u0447\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
'1251.4': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043B\u0435\u0433\u043A\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
'1251.5': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0445\u0430\u0440\u0447\u043E\u0432\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
'1251.6': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043C\u0435\u0434\u0438\u0447\u043D\u043E\u0457 \u0442\u0430 \u043C\u0456\u043A\u0440\u043E\u0431\u0456\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
'1251.7': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043B\u0456\u0441\u043E\u0432\u043E\u0457, \u0434\u0435\u0440\u0435\u0432\u043E\u043E\u0431\u0440\u043E\u0431\u043D\u043E\u0457 \u0442\u0430 \u0446\u0435\u043B\u044E\u043B\u043E\u0437\u043D\u043E-\u043F\u0430\u043F\u0435\u0440\u043E\u0432\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
'1251.8': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0431\u0443\u0434\u0456\u0432\u0435\u043B\u044C\u043D\u043E\u0457 \u0456\u043D\u0434\u0443\u0441\u0442\u0440\u0456\u0457, \u0431\u0443\u0434\u0456\u0432\u0435\u043B\u044C\u043D\u0438\u0445 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432 \u0442\u0430 \u0432\u0438\u0440\u043E\u0431\u0456\u0432, \u0441\u043A\u043B\u044F\u043D\u043E\u0457 \u0442\u0430 \u0444\u0430\u0440\u0444\u043E\u0440\u043E-\u0444\u0430\u044F\u043D\u0441\u043E\u0432\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
'1251.9': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0456\u043D\u0448\u0438\u0445 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0438\u0445 \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432, \u0432\u043A\u043B\u044E\u0447\u0430\u044E\u0447\u0438 \u043F\u043E\u043B\u0456\u0433\u0440\u0430\u0444\u0456\u0447\u043D\u0435"
'1252': "\u0420\u0435\u0437\u0435\u0440\u0432\u0443\u0430\u0440\u0438, \u0441\u0438\u043B\u043E\u0441\u0438 \u0442\u0430 \u0441\u043A\u043B\u0430\u0434\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0440\u0435\u0437\u0435\u0440\u0432\u0443\u0430\u0440\u0438 \u0442\u0430 \u0454\u043C\u043D\u043E\u0441\u0442\u0456\u0440\u0435\u0437\u0435\u0440\u0432\u0443\u0430\u0440\u0438 \u0434\u043B\u044F \u043D\u0430\u0444\u0442\u0438 \u0442\u0430 \u0433\u0430\u0437\u0443\u0441\u0438\u043B\u043E\u0441\u0438 \u0434\u043B\u044F \u0437\u0435\u0440\u043D\u0430, \u0446\u0435\u043C\u0435\u043D\u0442\u0443 \u0442\u0430 \u0456\u043D\u0448\u0438\u0445 \u0441\u0438\u043F\u043A\u0438\u0445 \u043C\u0430\u0441\u0445\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u0438\u043A\u0438 \u0442\u0430 \u0441\u043F\u0435\u0446\u0456\u0430\u043B\u044C\u043D\u0456 \u0441\u043A\u043B\u0430\u0434\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0441\u043A\u043B\u0430\u0434\u0441\u044C\u043A\u0456 \u043C\u0430\u0439\u0434\u0430\u043D\u0447\u0438\u043A\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u0456 \u0441\u0438\u043B\u043E\u0441\u0438 \u0442\u0430 \u0441\u043A\u043B\u0430\u0434\u0441\u044C\u043A\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456, \u0449\u043E \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F \u0434\u043B\u044F \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E \u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u0442\u0432\u0430 (12.71)\u0432\u043E\u0434\u043E\u043D\u0430\u043F\u0456\u0440\u043D\u0456 \u0431\u0430\u0448\u0442\u0438 (22.22)\u043D\u0430\u0444\u0442\u043E\u0442\u0435\u0440\u043C\u0456\u043D\u0430\u043B\u0438 (23.03)"
'1252.1': "\u0420\u0435\u0437\u0435\u0440\u0432\u0443\u0430\u0440\u0438 \u0434\u043B\u044F \u043D\u0430\u0444\u0442\u0438, \u043D\u0430\u0444\u0442\u043E\u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 \u0442\u0430 \u0433\u0430\u0437\u0443"
'1252.2': "\u0420\u0435\u0437\u0435\u0440\u0432\u0443\u0430\u0440\u0438 \u0442\u0430 \u0454\u043C\u043D\u043E\u0441\u0442\u0456 \u0456\u043D\u0448\u0456"
'1252.3': "\u0421\u0438\u043B\u043E\u0441\u0438 \u0434\u043B\u044F \u0437\u0435\u0440\u043D\u0430"
'1252.4': "\u0421\u0438\u043B\u043E\u0441\u0438 \u0434\u043B\u044F \u0446\u0435\u043C\u0435\u043D\u0442\u0443 \u0442\u0430 \u0456\u043D\u0448\u0438\u0445 \u0441\u0438\u043F\u0443\u0447\u0438\u0445 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432"
'1252.5': "\u0421\u043A\u043B\u0430\u0434\u0438 \u0441\u043F\u0435\u0446\u0456\u0430\u043B\u044C\u043D\u0456 \u0442\u043E\u0432\u0430\u0440\u043D\u0456"
'1252.6': "\u0425\u043E\u043B\u043E\u0434\u0438\u043B\u044C\u043D\u0438\u043A\u0438"
'1252.7': "\u0421\u043A\u043B\u0430\u0434\u0441\u044C\u043A\u0456 \u043C\u0430\u0439\u0434\u0430\u043D\u0447\u0438\u043A\u0438"
'1252.8': "\u0421\u043A\u043B\u0430\u0434\u0438 \u0443\u043D\u0456\u0432\u0435\u0440\u0441\u0430\u043B\u044C\u043D\u0456"
'1252.9': "\u0421\u043A\u043B\u0430\u0434\u0438 \u0442\u0430 \u0441\u0445\u043E\u0432\u0438\u0449\u0430 \u0456\u043D\u0448\u0456"
'126': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u043F\u0443\u0431\u043B\u0456\u0447\u043D\u0438\u0445 \u0432\u0438\u0441\u0442\u0443\u043F\u0456\u0432, \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432 \u043E\u0441\u0432\u0456\u0442\u043D\u044C\u043E\u0433\u043E, \u043C\u0435\u0434\u0438\u0447\u043D\u043E\u0433\u043E \u0442\u0430 \u043E\u0437\u0434\u043E\u0440\u043E\u0432\u0447\u043E\u0433\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F"
'1261': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u043F\u0443\u0431\u043B\u0456\u0447\u043D\u0438\u0445 \u0432\u0438\u0441\u0442\u0443\u043F\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043A\u0456\u043D\u043E\u0442\u0435\u0430\u0442\u0440\u0438, \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043D\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456, \u0442\u0435\u0430\u0442\u0440\u0438 \u0442\u0430 \u0442. \u0456\u043D.\u0437\u0430\u043B\u0438 \u0437\u0430\u0441\u0456\u0434\u0430\u043D\u044C \u0442\u0430 \u0431\u0430\u0433\u0430\u0442\u043E\u0446\u0456\u043B\u044C\u043E\u0432\u0456 \u0437\u0430\u043B\u0438, \u0449\u043E \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F, \u0433\u043E\u043B\u043E\u0432\u043D\u0438\u043C \u0447\u0438\u043D\u043E\u043C, \u0434\u043B\u044F \u043F\u0443\u0431\u043B\u0456\u0447\u043D\u0438\u0445 \u0432\u0438\u0441\u0442\u0443\u043F\u0456\u0432\u043A\u0430\u0437\u0438\u043D\u043E, \u0446\u0438\u0440\u043A\u0438, \u043C\u0443\u0437\u0438\u0447\u043D\u0456 \u0437\u0430\u043B\u0438 \u0442\u0430 \u0434\u0438\u0441\u043A\u043E\u0442\u0435\u043A\u0438, \u0435\u0441\u0442\u0440\u0430\u0434\u0438 \u0442\u0430 \u0442. \u0456\u043D.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u0443\u0437\u0435\u0457, \u0445\u0443\u0434\u043E\u0436\u043D\u0456 \u0433\u0430\u043B\u0435\u0440\u0435\u0457 (12.62)\u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u0456 \u0437\u0430\u043B\u0438 (12.65)\u043F\u0430\u0440\u043A\u0438 \u0434\u043B\u044F \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443 \u0442\u0430 \u0440\u043E\u0437\u0432\u0430\u0433 (24.12)"
'1261.1': "\u0422\u0435\u0430\u0442\u0440\u0438, \u043A\u0456\u043D\u043E\u0442\u0435\u0430\u0442\u0440\u0438 \u0442\u0430 \u043A\u043E\u043D\u0446\u0435\u0440\u0442\u043D\u0456 \u0437\u0430\u043B\u0438"
'1261.2': "\u0417\u0430\u043B\u0438 \u0437\u0430\u0441\u0456\u0434\u0430\u043D\u044C \u0442\u0430 \u0431\u0430\u0433\u0430\u0442\u043E\u0446\u0456\u043B\u044C\u043E\u0432\u0456 \u0437\u0430\u043B\u0438 \u0434\u043B\u044F \u043F\u0443\u0431\u043B\u0456\u0447\u043D\u0438\u0445 \u0432\u0438\u0441\u0442\u0443\u043F\u0456\u0432"
'1261.3': "\u0426\u0438\u0440\u043A\u0438"
'1261.4': "\u041A\u0430\u0437\u0438\u043D\u043E, \u0456\u0433\u043E\u0440\u043D\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438"
'1261.5': "\u041C\u0443\u0437\u0438\u0447\u043D\u0456 \u0442\u0430 \u0442\u0430\u043D\u0446\u044E\u0432\u0430\u043B\u044C\u043D\u0456 \u0437\u0430\u043B\u0438, \u0434\u0438\u0441\u043A\u043E\u0442\u0435\u043A\u0438"
'1261.9': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u043F\u0443\u0431\u043B\u0456\u0447\u043D\u0438\u0445 \u0432\u0438\u0441\u0442\u0443\u043F\u0456\u0432 \u0456\u043D\u0448\u0456"
'1262': "\u041C\u0443\u0437\u0435\u0457 \u0442\u0430 \u0431\u0456\u0431\u043B\u0456\u043E\u0442\u0435\u043A\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u0443\u0437\u0435\u0457, \u0445\u0443\u0434\u043E\u0436\u043D\u0456 \u0433\u0430\u043B\u0435\u0440\u0435\u0457, \u0431\u0456\u0431\u043B\u0456\u043E\u0442\u0435\u043A\u0438 \u0442\u0430 \u0442\u0435\u0445\u043D\u0456\u0447\u043D\u0456 \u0446\u0435\u043D\u0442\u0440\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0430\u0440\u0445\u0456\u0432\u0456\u0432\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0437\u043E\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0438\u0445 \u0442\u0430 \u0431\u043E\u0442\u0430\u043D\u0456\u0447\u043D\u0438\u0445 \u0441\u0430\u0434\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043F\u0430\u043C'\u044F\u0442\u043A\u0438 \u0456\u0441\u0442\u043E\u0440\u0456\u0457 (12.73)"
'1262.1': "\u041C\u0443\u0437\u0435\u0457 \u0442\u0430 \u0445\u0443\u0434\u043E\u0436\u043D\u0456 \u0433\u0430\u043B\u0435\u0440\u0435\u0457"
'1262.2': "\u0411\u0456\u0431\u043B\u0456\u043E\u0442\u0435\u043A\u0438, \u043A\u043D\u0438\u0433\u043E\u0441\u0445\u043E\u0432\u0438\u0449\u0430"
'1262.3': "\u0422\u0435\u0445\u043D\u0456\u0447\u043D\u0456 \u0446\u0435\u043D\u0442\u0440\u0438"
'1262.4': "\u041F\u043B\u0430\u043D\u0435\u0442\u0430\u0440\u0456\u0457"
'1262.5': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0430\u0440\u0445\u0456\u0432\u0456\u0432"
'1262.6': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0437\u043E\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0438\u0445 \u0442\u0430 \u0431\u043E\u0442\u0430\u043D\u0456\u0447\u043D\u0438\u0445 \u0441\u0430\u0434\u0456\u0432"
'1263': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0442\u0430 \u0434\u043E\u0441\u043B\u0456\u0434\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u0434\u043E\u0448\u043A\u0456\u043B\u044C\u043D\u043E\u0433\u043E \u0442\u0430 \u043F\u043E\u0447\u0430\u0442\u043A\u043E\u0432\u043E\u0433\u043E \u043D\u0430\u0432\u0447\u0430\u043D\u043D\u044F, \u043E\u0442\u0440\u0438\u043C\u0430\u043D\u043D\u044F \u0441\u0435\u0440\u0435\u0434\u043D\u044C\u043E\u0457 \u043E\u0441\u0432\u0456\u0442\u0438 (\u0434\u0438\u0442\u044F\u0447\u0456 \u044F\u0441\u043B\u0430 \u0442\u0430 \u0441\u0430\u0434\u0438, \u0448\u043A\u043E\u043B\u0438, \u043A\u043E\u043B\u0435\u0434\u0436\u0456, \u043B\u0456\u0446\u0435\u0457, \u0433\u0456\u043C\u043D\u0430\u0437\u0456\u0457 \u0442\u043E\u0449\u043E), \u0441\u043F\u0435\u0446\u0456\u0430\u043B\u0456\u0437\u043E\u0432\u0430\u043D\u0456 (\u0444\u0430\u0445\u043E\u0432\u0456) \u0448\u043A\u043E\u043B\u0438, \u043F\u0440\u043E\u0444\u0435\u0441\u0456\u0439\u043D\u043E-\u0442\u0435\u0445\u043D\u0456\u0447\u043D\u0456 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0456 \u0437\u0430\u043A\u043B\u0430\u0434\u0438\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u0432\u0438\u0449\u0438\u0445 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432, \u043D\u0430\u0443\u043A\u043E\u0432\u043E-\u0434\u043E\u0441\u043B\u0456\u0434\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432, \u043B\u0430\u0431\u043E\u0440\u0430\u0442\u043E\u0440\u0456\u0439.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0441\u043F\u0435\u0446\u0456\u0430\u043B\u0456\u0437\u043E\u0432\u0430\u043D\u0456 \u0448\u043A\u043E\u043B\u0438 \u0434\u043B\u044F \u0434\u0456\u0442\u0435\u0439 \u0437 \u0444\u0456\u0437\u0438\u0447\u043D\u0438\u043C\u0438 \u0430\u0431\u043E \u0440\u043E\u0437\u0443\u043C\u043E\u0432\u0438\u043C\u0438 \u0432\u0430\u0434\u0430\u043C\u0438\u0437\u0430\u043A\u043B\u0430\u0434\u0438 \u0434\u043B\u044F \u0444\u0430\u0445\u043E\u0432\u043E\u0457 \u043F\u0435\u0440\u0435\u043F\u0456\u0434\u0433\u043E\u0442\u043E\u0432\u043A\u0438\u043C\u0435\u0442\u0435\u043E\u0440\u043E\u043B\u043E\u0433\
  \u0456\u0447\u043D\u0456 \u0441\u0442\u0430\u043D\u0446\u0456\u0457, \u043E\u0431\u0441\u0435\u0440\u0432\u0430\u0442\u043E\u0440\u0456\u0457.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0433\u0443\u0440\u0442\u043E\u0436\u0438\u0442\u043A\u0438 \u0434\u043B\u044F \u0441\u0442\u0443\u0434\u0435\u043D\u0442\u0456\u0432 \u0442\u0430 \u0443\u0447\u043D\u0456\u0432 (11.30)\u0431\u0456\u0431\u043B\u0456\u043E\u0442\u0435\u043A\u0438 (12.62)\u043B\u0456\u043A\u0430\u0440\u043D\u0456 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432 (12.64)"
'1263.1': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043D\u0430\u0443\u043A\u043E\u0432\u043E-\u0434\u043E\u0441\u043B\u0456\u0434\u043D\u0438\u0445 \u0442\u0430 \u043F\u0440\u043E\u0435\u043A\u0442\u043D\u043E-\u0432\u0438\u0448\u0443\u043A\u0443\u0432\u0430\u043B\u044C\u043D\u0438\u0445 \u0443\u0441\u0442\u0430\u043D\u043E\u0432"
'1263.2': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0432\u0438\u0449\u0438\u0445 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432"
'1263.3': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0448\u043A\u0456\u043B \u0442\u0430 \u0456\u043D\u0448\u0438\u0445 \u0441\u0435\u0440\u0435\u0434\u043D\u0456\u0445 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432"
'1263.4': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0440\u043E\u0444\u0435\u0441\u0456\u0439\u043D\u043E-\u0442\u0435\u0445\u043D\u0456\u0447\u043D\u0438\u0445 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432"
'1263.5': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043E\u0448\u043A\u0456\u043B\u044C\u043D\u0438\u0445 \u0442\u0430 \u043F\u043E\u0437\u0430\u0448\u043A\u0456\u043B\u044C\u043D\u0438\u0445 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432"
'1263.6': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0441\u043F\u0435\u0446\u0456\u0430\u043B\u044C\u043D\u0438\u0445 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432 \u0434\u043B\u044F \u0434\u0456\u0442\u0435\u0439 \u0437 \u0444\u0456\u0437\u0438\u0447\u043D\u0438\u043C\u0438 \u0430\u0431\u043E \u0440\u043E\u0437\u0443\u043C\u043E\u0432\u0438\u043C\u0438 \u0432\u0430\u0434\u0430\u043C\u0438"
'1263.7': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432 \u0437 \u0444\u0430\u0445\u043E\u0432\u043E\u0457 \u043F\u0435\u0440\u0435\u043F\u0456\u0434\u0433\u043E\u0442\u043E\u0432\u043A\u0438"
'1263.8': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043C\u0435\u0442\u0435\u043E\u0440\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0438\u0445 \u0441\u0442\u0430\u043D\u0446\u0456\u0439, \u043E\u0431\u0441\u0435\u0440\u0432\u0430\u0442\u043E\u0440\u0456\u0439"
'1263.9': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043E\u0441\u0432\u0456\u0442\u043D\u0456\u0445 \u0442\u0430 \u043D\u0430\u0443\u043A\u043E\u0432\u043E-\u0434\u043E\u0441\u043B\u0456\u0434\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432 \u0456\u043D\u0448\u0456"
'1264': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043B\u0456\u043A\u0430\u0440\u0435\u043D\u044C \u0442\u0430 \u043E\u0437\u0434\u043E\u0440\u043E\u0432\u0447\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0437\u0430\u043A\u043B\u0430\u0434\u0438 \u0437 \u043D\u0430\u0434\u0430\u043D\u043D\u044F \u043C\u0435\u0434\u0438\u0447\u043D\u043E\u0457 \u0434\u043E\u043F\u043E\u043C\u043E\u0433\u0438 \u0445\u0432\u043E\u0440\u0438\u043C \u0442\u0430 \u0442\u0440\u0430\u0432\u043C\u043E\u0432\u0430\u043D\u0438\u043C \u043F\u0430\u0446\u0456\u0454\u043D\u0442\u0430\u043C\u0441\u0430\u043D\u0430\u0442\u043E\u0440\u0456\u0457, \u043F\u0440\u043E\u0444\u0456\u043B\u0430\u043A\u0442\u043E\u0440\u0456\u0457, \u0441\u043F\u0435\u0446\u0456\u0430\u043B\u0456\u0437\u043E\u0432\u0430\u043D\u0456 \u043B\u0456\u043A\u0430\u0440\u043D\u0456, \u043F\u0441\u0438\u0445\u0456\u0430\u0442\u0440\u0438\u0447\u043D\u0456 \u0434\u0438\u0441\u043F\u0430\u043D\u0441\u0435\u0440\u0438, \u043F\u043E\u043B\u043E\u0433\u043E\u0432\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438, \u043C\u0430\u0442\u0435\u0440\u0438\u043D\u0441\u044C\u043A\u0456 \u0442\u0430 \u0434\u0438\u0442\u044F\u0447\u0456 \u0440\u0435\u0430\u0431\u0456\u043B\u0456\u0442\u0430\u0446\u0456\u0439\u043D\u0456 \u0446\u0435\u043D\u0442\u0440\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043B\u0456\u043A\u0430\u0440\u043D\u0456 \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432, \u0448\u043F\u0438\u0442\u0430\u043B\u0456 \u0432\u0438\u043F\u0440\u0430\u0432\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432, \u0432'\u044F\u0437\u043D\u0438\u0446\u044C \u0442\u0430 \u0437\u0431\u0440\u043E\u0439\u043D\u0438\u0445 \u0441\u0438\u043B\u0431\u0443\u0434\u0456\u0432\u043B\u0456, \u0449\u043E \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F \u0434\u043B\u044F \u0442\u0435\u0440\u043C\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0442\u0430 \u0441\u043E\u043B\u044F\u043D\u043E\u0433\u043E \u043B\u0456\u043A\u0443\u0432\u0430\u043D\u043D\u044F, \u0444\u0443\u043D\u043A\u0446\u0456\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u0457 \u0440\u0435\u0430\u0431\u0456\u043B\u0456\u0442\u0430\u0446\u0456\u0457, \u043F\u0443\u043D\u043A\u0442\u0456\
  \u0432 \u043F\u0435\u0440\u0435\u043B\u0438\u0432\u0430\u043D\u043D\u044F \u043A\u0440\u043E\u0432\u0456, \u043F\u0443\u043D\u043A\u0442\u0456\u0432 \u0434\u043E\u043D\u043E\u0440\u0441\u044C\u043A\u043E\u0433\u043E \u0433\u0440\u0443\u0434\u043D\u043E\u0433\u043E \u043C\u043E\u043B\u043E\u043A\u0430 \u0442\u0430 \u0442. \u0456\u043D.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0431\u0443\u0434\u0438\u043D\u043A\u0438-\u0456\u043D\u0442\u0435\u0440\u043D\u0430\u0442\u0438 \u0434\u043B\u044F \u043B\u044E\u0434\u0435\u0439 \u043F\u043E\u0445\u0438\u043B\u043E\u0433\u043E \u0432\u0456\u043A\u0443 \u0442\u0430 \u0456\u043D\u0432\u0430\u043B\u0456\u0434\u0456\u0432 (11.30)"
'1264.1': "\u041B\u0456\u043A\u0430\u0440\u043D\u0456 \u0431\u0430\u0433\u0430\u0442\u043E\u043F\u0440\u043E\u0444\u0456\u043B\u044C\u043D\u0456 \u0442\u0435\u0440\u0438\u0442\u043E\u0440\u0456\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F, \u043D\u0430\u0432\u0447\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432"
'1264.2': "\u041B\u0456\u043A\u0430\u0440\u043D\u0456 \u043F\u0440\u043E\u0444\u0456\u043B\u044C\u043D\u0456, \u0434\u0438\u0441\u043F\u0430\u043D\u0441\u0435\u0440\u0438"
'1264.3': "\u041C\u0430\u0442\u0435\u0440\u0438\u043D\u0441\u044C\u043A\u0456 \u0442\u0430 \u0434\u0438\u0442\u044F\u0447\u0456 \u0440\u0435\u0430\u0431\u0456\u043B\u0456\u0442\u0430\u0446\u0456\u0439\u043D\u0456 \u0446\u0435\u043D\u0442\u0440\u0438, \u043F\u043E\u043B\u043E\u0433\u043E\u0432\u0456 \u0431\u0443\u0434\u0438\u043D\u043A\u0438"
'1264.4': "\u041F\u043E\u043B\u0456\u043A\u043B\u0456\u043D\u0456\u043A\u0438, \u043F\u0443\u043D\u043A\u0442\u0438 \u043C\u0435\u0434\u0438\u0447\u043D\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u043A\u043E\u043D\u0441\u0443\u043B\u044C\u0442\u0430\u0446\u0456\u0457"
'1264.5': "\u0428\u043F\u0438\u0442\u0430\u043B\u0456 \u0432\u0438\u043F\u0440\u0430\u0432\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432, \u0432'\u044F\u0437\u043D\u0438\u0446\u044C \u0442\u0430 \u0437\u0431\u0440\u043E\u0439\u043D\u0438\u0445 \u0441\u0438\u043B"
'1264.6': "\u0421\u0430\u043D\u0430\u0442\u043E\u0440\u0456\u0457, \u043F\u0440\u043E\u0444\u0456\u043B\u0430\u043A\u0442\u043E\u0440\u0456\u0457 \u0442\u0430 \u0446\u0435\u043D\u0442\u0440\u0438 \u0444\u0443\u043D\u043A\u0446\u0456\u043E\u043D\u0430\u043B\u044C\u043D\u043E\u0457 \u0440\u0435\u0430\u0431\u0456\u043B\u0456\u0442\u0430\u0446\u0456\u0457"
'1264.9': "\u0417\u0430\u043A\u043B\u0430\u0434\u0438 \u043B\u0456\u043A\u0443\u0432\u0430\u043B\u044C\u043D\u043E-\u043F\u0440\u043E\u0444\u0456\u043B\u0430\u043A\u0442\u0438\u0447\u043D\u0456 \u0442\u0430 \u043E\u0437\u0434\u043E\u0440\u043E\u0432\u0447\u0456 \u0456\u043D\u0448\u0456"
'1265': "\u0417\u0430\u043B\u0438 \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0431\u0443\u0434\u0456\u0432\u043B\u0456, \u0449\u043E \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F \u0432 \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u0438\u0445 \u0446\u0456\u043B\u044F\u0445 (\u0431\u0430\u0441\u043A\u0435\u0442\u0431\u043E\u043B \u0442\u0430 \u0442\u0435\u043D\u0456\u0441 \u0443 \u043F\u0440\u0438\u043C\u0456\u0449\u0435\u043D\u043D\u044F\u0445, \u043F\u043B\u0430\u0432\u0430\u043B\u044C\u043D\u0456 \u0431\u0430\u0441\u0435\u0439\u043D\u0438, \u0433\u0456\u043C\u043D\u0430\u0441\u0442\u0438\u0447\u043D\u0456 \u0437\u0430\u043B\u0438, \u043A\u043E\u0432\u0437\u0430\u043D\u043A\u0438 \u0430\u0431\u043E \u0445\u043E\u043A\u0435\u0439\u043D\u0456 \u043C\u0430\u0439\u0434\u0430\u043D\u0447\u0438\u043A\u0438 \u0442\u0430 \u0442. \u0456\u043D.), \u0449\u043E \u043F\u0435\u0440\u0435\u0434\u0431\u0430\u0447\u0430\u044E\u0442\u044C\u0441\u044F \u043F\u0435\u0440\u0435\u043E\u0431\u043B\u0430\u0434\u043D\u0430\u043D\u043D\u044F \u0437 \u0443\u043B\u0430\u0448\u0442\u0443\u0432\u0430\u043D\u043D\u044F\u043C \u0442\u0440\u0438\u0431\u0443\u043D \u0434\u043B\u044F \u0433\u043B\u044F\u0434\u0430\u0447\u0456\u0432, \u0442\u0435\u0440\u0430\u0441 \u0434\u043B\u044F \u0432\u0438\u0434\u043E\u0432\u0438\u0449 \u0442\u0430 \u0434\u0435\u043C\u043E\u043D\u0441\u0442\u0440\u0430\u0446\u0456\u0439\u043D\u0438\u0445 \u0446\u0456\u043B\u0435\u0439 \u0442\u0430 \u0442. \u0456\u043D.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0431\u0430\u0433\u0430\u0442\u043E\u0446\u0456\u043B\u044C\u043E\u0432\u0456 \u0437\u0430\u043B\u0438, \u0449\u043E \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F, \u0433\u043E\u043B\u043E\u0432\u043D\u0438\u043C \u0447\u0438\u043D\u043E\u043C, \u0434\u043B\u044F \u043F\u0443\u0431\u043B\u0456\u0447\u043D\u0438\u0445 \u0432\u0438\u0441\u0442\u0443\u043F\u0456\u0432 (12.61)\u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u0456 \u043C\u0430\u0439\u0434\u0430\u043D\u0447\u0438\u043A\u0438 \u0434\u043B\u044F \u0437\u0430\u043D\u044F\u0442\u044C \u0441\u043F\u043E\u0440\u0442\u043E\u043C \u043D\u0430 \u0432\u0456\u0434\u043A\u0440\u0438\u0442\u043E\u043C\u0443 \u043F\u043E\u0432\u0456\u0442\u0440\u0456, \u043D\
  \u0430\u043F\u0440\u0438\u043A\u043B\u0430\u0434, \u0442\u0435\u043D\u0456\u0441\u043D\u0456 \u043A\u043E\u0440\u0442\u0438, \u0432\u0456\u0434\u043A\u0440\u0438\u0442\u0456 \u043F\u043B\u0430\u0432\u0430\u043B\u044C\u043D\u0456 \u0431\u0430\u0441\u0435\u0439\u043D\u0438 \u0442\u043E\u0449\u043E (24.11)"
'1265.1': "\u0417\u0430\u043B\u0438 \u0433\u0456\u043C\u043D\u0430\u0441\u0442\u0438\u0447\u043D\u0456, \u0431\u0430\u0441\u043A\u0435\u0442\u0431\u043E\u043B\u044C\u043D\u0456, \u0432\u043E\u043B\u0435\u0439\u0431\u043E\u043B\u044C\u043D\u0456, \u0442\u0435\u043D\u0456\u0441\u043D\u0456 \u0442\u0430 \u0442. \u0456\u043D"
'1265.2': "\u0411\u0430\u0441\u0435\u0439\u043D\u0438 \u043A\u0440\u0438\u0442\u0456 \u0434\u043B\u044F \u043F\u043B\u0430\u0432\u0430\u043D\u043D\u044F"
'1265.3': "\u0425\u043E\u043A\u0435\u0439\u043D\u0456 \u0442\u0430 \u043B\u044C\u043E\u0434\u043E\u0432\u0456 \u0441\u0442\u0430\u0434\u0456\u043E\u043D\u0438 \u043A\u0440\u0438\u0442\u0456"
'1265.4': "\u041C\u0430\u043D\u0435\u0436\u0456 \u043B\u0435\u0433\u043A\u043E\u0430\u0442\u043B\u0435\u0442\u0438\u0447\u043D\u0456"
'1265.5': "\u0422\u0438\u0440\u0438"
'1265.9': "\u0417\u0430\u043B\u0438 \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u0456 \u0456\u043D\u0448\u0456"
'127': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043D\u0435\u0436\u0438\u0442\u043B\u043E\u0432\u0456 \u0456\u043D\u0448\u0456"
'1271': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u043E\u0433\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F, \u043B\u0456\u0441\u0456\u0432\u043D\u0438\u0446\u0442\u0432\u0430 \u0442\u0430 \u0440\u0438\u0431\u043D\u043E\u0433\u043E \u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u0442\u0432\u0430.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u0430\u043D\u043D\u044F \u0432 \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u0456\u0439 \u0434\u0456\u044F\u043B\u044C\u043D\u043E\u0441\u0442\u0456, \u043D\u0430\u043F\u0440\u0438\u043A\u043B\u0430\u0434, \u043A\u043E\u0440\u0456\u0432\u043D\u0438\u043A\u0438, \u0441\u0442\u0430\u0439\u043D\u0456, \u0441\u0432\u0438\u043D\u0430\u0440\u043D\u0438\u043A\u0438, \u043A\u043E\u0448\u0430\u0440\u0438, \u043A\u0456\u043D\u043D\u0456 \u0437\u0430\u0432\u043E\u0434\u0438, \u0441\u043E\u0431\u0430\u0447\u0456 \u0440\u043E\u0437\u043F\u043B\u0456\u0434\u043D\u0438\u043A\u0438, \u043F\u0442\u0430\u0445\u043E\u0444\u0430\u0431\u0440\u0438\u043A\u0438, \u0437\u0435\u0440\u043D\u043E\u0441\u0445\u043E\u0432\u0438\u0449\u0430, \u0441\u043A\u043B\u0430\u0434\u0438 \u0442\u0430 \u043D\u0430\u0434\u0432\u0456\u0440\u043D\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456, \u043F\u0456\u0434\u0432\u0430\u043B\u0438, \u0432\u0438\u043D\u043E\u043A\u0443\u0440\u043D\u0456, \u0432\u0438\u043D\u043D\u0456 \u0454\u043C\u043D\u043E\u0441\u0442\u0456, \u0442\u0435\u043F\u043B\u0438\u0446\u0456, \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u0456 \u0441\u0438\u043B\u043E\u0441\u0438 \u0442\u0430 \u0442. \u0456\u043D.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0437\u043E\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0438\u0445 \u0442\u0430 \u0431\u043E\u0442\u0430\u043D\u0456\u0447\u043D\u0438\u0445 \u0441\u0430\u0434\u0456\u0432 (24.12)"
'1271.1': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u0442\u0432\u0430\u0440\u0438\u043D\u043D\u0438\u0446\u0442\u0432\u0430"
'1271.2': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u043F\u0442\u0430\u0445\u0456\u0432\u043D\u0438\u0446\u0442\u0432\u0430"
'1271.3': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u043D\u043D\u044F \u0437\u0435\u0440\u043D\u0430"
'1271.4': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0441\u0438\u043B\u043E\u0441\u043D\u0456 \u0442\u0430 \u0441\u0456\u043D\u0430\u0436\u043D\u0456"
'1271.5': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u0441\u0430\u0434\u0456\u0432\u043D\u0438\u0446\u0442\u0432\u0430, \u0432\u0438\u043D\u043E\u0433\u0440\u0430\u0434\u0430\u0440\u0441\u0442\u0432\u0430 \u0442\u0430 \u0432\u0438\u043D\u043E\u0440\u043E\u0431\u0441\u0442\u0432\u0430"
'1271.6': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0442\u0435\u043F\u043B\u0438\u0447\u043D\u043E\u0433\u043E \u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u0442\u0432\u0430"
'1271.7': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0440\u0438\u0431\u043D\u043E\u0433\u043E \u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u0442\u0432\u0430"
'1271.8': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043B\u0456\u0441\u0456\u0432\u043D\u0438\u0446\u0442\u0432\u0430 \u0442\u0430 \u0437\u0432\u0456\u0440\u0456\u0432\u043D\u0438\u0446\u0442\u0432\u0430"
'1271.9': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u043E\u0433\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F \u0456\u043D\u0448\u0456"
'1272': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0434\u043B\u044F \u043A\u0443\u043B\u044C\u0442\u043E\u0432\u043E\u0457 \u0442\u0430 \u0440\u0435\u043B\u0456\u0433\u0456\u0439\u043D\u043E\u0457 \u0434\u0456\u044F\u043B\u044C\u043D\u043E\u0441\u0442\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0446\u0435\u0440\u043A\u0432\u0438, \u043A\u0430\u043F\u043B\u0438\u0446\u0456, \u043C\u0435\u0447\u0435\u0442\u0456, \u0441\u0438\u043D\u0430\u0433\u043E\u0433\u0438 \u0442\u0430 \u0442. \u0456\u043D.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0446\u0432\u0438\u043D\u0442\u0430\u0440\u0456 \u0442\u0430 \u043F\u043E\u0445\u043E\u0440\u043E\u043D\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438, \u0440\u0438\u0442\u0443\u0430\u043B\u044C\u043D\u0456 \u0437\u0430\u043B\u0438, \u043A\u0440\u0435\u043C\u0430\u0442\u043E\u0440\u0456\u0457.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0441\u0432\u0456\u0442\u0441\u044C\u043A\u0456 \u0440\u0435\u043B\u0456\u0433\u0456\u0439\u043D\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456 (12.62)\u043A\u0443\u043B\u044C\u0442\u043E\u0432\u0456 \u0442\u0430 \u0440\u0435\u043B\u0456\u0433\u0456\u0439\u043D\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456, \u0449\u043E \u043D\u0435 \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F \u0437\u0430 \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F\u043C, \u0430 \u0454 \u043F\u0430\u043C'\u044F\u0442\u043A\u0430\u043C\u0438 \u0456\u0441\u0442\u043E\u0440\u0456\u0457 \u0442\u0430 \u0430\u0440\u0445\u0456\u0442\u0435\u043A\u0442\u0443\u0440\u0438 (12.73)"
'1272.1': "\u0426\u0435\u0440\u043A\u0432\u0438, \u0441\u043E\u0431\u043E\u0440\u0438, \u043A\u043E\u0441\u0442\u044C\u043E\u043B\u0438, \u043C\u0435\u0447\u0435\u0442\u0456, \u0441\u0438\u043D\u0430\u0433\u043E\u0433\u0438 \u0442\u0430 \u0442. \u0456\u043D"
'1272.2': "\u041F\u043E\u0445\u043E\u0440\u043E\u043D\u043D\u0456 \u0431\u044E\u0440\u043E \u0442\u0430 \u0440\u0438\u0442\u0443\u0430\u043B\u044C\u043D\u0456 \u0437\u0430\u043B\u0438"
'1272.3': "\u0426\u0432\u0438\u043D\u0442\u0430\u0440\u0456 \u0442\u0430 \u043A\u0440\u0435\u043C\u0430\u0442\u043E\u0440\u0456\u0457"
'1273': "\u041F\u0430\u043C'\u044F\u0442\u043A\u0438 \u0456\u0441\u0442\u043E\u0440\u0438\u0447\u043D\u0456 \u0442\u0430 \u0442\u0430\u043A\u0456, \u0449\u043E \u043E\u0445\u043E\u0440\u043E\u043D\u044F\u044E\u0442\u044C\u0441\u044F \u0434\u0435\u0440\u0436\u0430\u0432\u043E\u044E.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0456\u0441\u0442\u043E\u0440\u0438\u0447\u043D\u0456 \u0442\u0430 \u0442\u0430\u043A\u0456, \u0449\u043E \u043E\u0445\u043E\u0440\u043E\u043D\u044F\u044E\u0442\u044C\u0441\u044F \u0434\u0435\u0440\u0436\u0430\u0432\u043E\u044E \u0456 \u043D\u0435 \u0432\u0438\u043E\u043A\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F \u0434\u043B\u044F \u0456\u043D\u0448\u0438\u0445 \u0446\u0456\u043B\u0435\u0439.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0441\u0442\u0430\u0440\u043E\u0432\u0438\u043D\u043D\u0456 \u0440\u0443\u0457\u043D\u0438, \u0449\u043E \u043E\u0445\u043E\u0440\u043E\u043D\u044F\u044E\u0442\u044C\u0441\u044F \u0434\u0435\u0440\u0436\u0430\u0432\u043E\u044E, \u0430\u0440\u0445\u0435\u043E\u043B\u043E\u0433\u043E\u0433\u0456\u0447\u043D\u0456 \u0440\u043E\u0437\u043A\u043E\u043F\u043A\u0438\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u043C\u0435\u043C\u043E\u0440\u0456\u0430\u043B\u044C\u043D\u043E\u0433\u043E, \u0445\u0443\u0434\u043E\u0436\u043D\u044C\u043E\u0433\u043E \u0456 \u0434\u0435\u043A\u043E\u0440\u0430\u0442\u0438\u0432\u043D\u043E\u0433\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F, \u0441\u0442\u0430\u0442\u0443\u0457.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u0443\u0437\u0435\u0457 (12.62)"
'1273.1': "\u041F\u0430\u043C'\u044F\u0442\u043A\u0438 \u0456\u0441\u0442\u043E\u0440\u0456\u0457 \u0442\u0430 \u0430\u0440\u0445\u0456\u0442\u0435\u043A\u0442\u0443\u0440\u0438"
'1273.2': "\u0410\u0440\u0445\u0435\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0456 \u0440\u043E\u0437\u043A\u043E\u043F\u043A\u0438, \u0440\u0443\u0457\u043D\u0438 \u0442\u0430 \u0456\u0441\u0442\u043E\u0440\u0438\u0447\u043D\u0456 \u043C\u0456\u0441\u0446\u044F, \u0449\u043E \u043E\u0445\u043E\u0440\u043E\u043D\u044F\u044E\u0442\u044C\u0441\u044F \u0434\u0435\u0440\u0436\u0430\u0432\u043E\u044E"
'1273.3': "\u041C\u0435\u043C\u043E\u0440\u0456\u0430\u043B\u0438, \u0445\u0443\u0434\u043E\u0436\u043D\u044C\u043E-\u0434\u0435\u043A\u043E\u0440\u0430\u0442\u0438\u0432\u043D\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456, \u0441\u0442\u0430\u0442\u0443\u0457"
'1274': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0456\u043D\u0448\u0456, \u043D\u0435 \u043A\u043B\u0430\u0441\u0438\u0444\u0456\u043A\u043E\u0432\u0430\u043D\u0456 \u0440\u0430\u043D\u0456\u0448\u0435.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0432\u0438\u043F\u0440\u0430\u0432\u043D\u0456 \u0437\u0430\u043A\u043B\u0430\u0434\u0438, \u0432'\u044F\u0437\u043D\u0438\u0446\u0456, \u0441\u043B\u0456\u0434\u0447\u0456 \u0456\u0437\u043E\u043B\u044F\u0442\u043E\u0440\u0438, \u0430\u0440\u043C\u0456\u0439\u0441\u044C\u043A\u0456 \u043A\u0430\u0437\u0430\u0440\u043C\u0438, \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u043C\u0456\u043B\u0456\u0446\u0435\u0439\u0441\u044C\u043A\u0438\u0445 \u0438\u0430 \u043F\u043E\u0436\u0435\u0436\u043D\u0438\u0445 \u0441\u043B\u0443\u0436\u0431.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0431\u0443\u0434\u0456\u0432\u043B\u0456, \u0442\u0430\u043A\u0456 \u044F\u043A \u0430\u0432\u0442\u043E\u0431\u0443\u0441\u043D\u0456 \u0437\u0443\u043F\u0438\u043D\u043A\u0438, \u0433\u0440\u043E\u043C\u0430\u0434\u0441\u044C\u043A\u0456 \u0442\u0443\u0430\u043B\u0435\u0442\u0438, \u043F\u0440\u0430\u043B\u044C\u043D\u0456, \u043B\u0430\u0437\u043D\u0456 \u0442\u0430 \u0442. \u0456\u043D.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0442\u0435\u043B\u0435\u0444\u043E\u043D\u043D\u0456 \u043A\u0456\u043E\u0441\u043A\u0438 (12.41)\u0433\u043E\u0441\u043F\u0456\u0442\u0430\u043B\u0456 \u0432\u0438\u043F\u0440\u0430\u0432\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432, \u0432'\u044F\u0437\u043D\u0438\u0446\u044C, \u0437\u0431\u0440\u043E\u0439\u043D\u0438\u0445 \u0441\u0438\u043B (12.64)\u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0456 \u0456\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 (24.20)"
'1274.1': "\u041A\u0430\u0437\u0430\u0440\u043C\u0438 \u0437\u0431\u0440\u043E\u0439\u043D\u0438\u0445 \u0441\u0438\u043B"
'1274.2': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043C\u0456\u043B\u0456\u0446\u0435\u0439\u0441\u044C\u043A\u0438\u0445 \u0442\u0430 \u043F\u043E\u0436\u0435\u0436\u043D\u0438\u0445 \u0441\u043B\u0443\u0436\u0431"
'1274.3': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0432\u0438\u043F\u0440\u0430\u0432\u043D\u0438\u0445 \u0437\u0430\u043A\u043B\u0430\u0434\u0456\u0432, \u0432'\u044F\u0437\u043D\u0438\u0446\u044C \u0442\u0430 \u0441\u043B\u0456\u0434\u0447\u0438\u0445 \u0456\u0437\u043E\u043B\u044F\u0442\u043E\u0440\u0456\u0432"
'1274.4': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u043B\u0430\u0437\u0435\u043D\u044C \u0442\u0430 \u043F\u0440\u0430\u043B\u0435\u043D\u044C"
'1274.5': "\u0411\u0443\u0434\u0456\u0432\u043B\u0456 \u0437 \u043E\u0431\u043B\u0430\u0448\u0442\u0443\u0432\u0430\u043D\u043D\u044F \u043D\u0430\u0441\u0435\u043B\u0435\u043D\u0438\u0445 \u043F\u0443\u043D\u043A\u0442\u0456\u0432"
'21': "\u0422\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438"
'211': "\u0410\u0432\u0442\u043E\u0441\u0442\u0440\u0430\u0434\u0438, \u0432\u0443\u043B\u0438\u0446\u0456 \u0442\u0430 \u0434\u043E\u0440\u043E\u0433\u0438"
'2111': "\u0410\u0432\u0442\u043E\u0441\u0442\u0440\u0430\u0434\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u0456 \u0448\u043B\u044F\u0445\u0438 \u0442\u0430 \u0434\u043E\u0440\u043E\u0433\u0438 \u0434\u043B\u044F \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0438\u0445 \u0442\u0440\u0430\u0441, \u0432\u043A\u043B\u044E\u0447\u0430\u044E\u0447\u0438 \u043F\u0435\u0440\u0435\u0445\u0440\u0435\u0441\u0442\u044F \u0442\u0430 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u0456 \u0440\u043E\u0437\u0432'\u044F\u0437\u043A\u0438 \u0432 \u0440\u0456\u0437\u043D\u0438\u0445 \u0440\u0456\u0432\u043D\u044F\u0445.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0441\u0442\u043E\u044F\u043D\u043E\u043A.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0442\u0435\u0445\u043D\u0456\u0447\u043D\u043E\u0433\u043E \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u0456\u0432 (12.30)\u043C\u043E\u0441\u0442\u0438 \u0442\u0430 \u0435\u0441\u0442\u0430\u043A\u0430\u0434\u0438 (21.41)\u0442\u0443\u043D\u0435\u043B\u0456 \u0442\u0430 \u043C\u0435\u0442\u0440\u043E (21.42)"
'2111.1': "\u0414\u043E\u0440\u043E\u0433\u0438 \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u0456 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456"
'2111.2': "\u041F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0441\u0442\u043E\u044F\u043D\u043E\u043A \u043D\u0430 \u0430\u0432\u0442\u043E\u0441\u0442\u0440\u0430\u0434\u0430\u0445"
'2112': "\u0412\u0443\u043B\u0438\u0446\u0456 \u0442\u0430 \u0434\u043E\u0440\u043E\u0433\u0438. \u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u0456\u0441\u044C\u043A\u0456 \u0442\u0430 \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u0456 \u0432\u0443\u043B\u0438\u0446\u0456, \u043F\u043E\u0437\u0430\u043C\u0456\u0441\u044C\u043A\u0456 \u0434\u043E\u0440\u043E\u0433\u0438 \u0442\u0430 \u0431\u0443\u0434\u044C-\u044F\u043A\u0456 \u0448\u043B\u044F\u0445\u0438 (\u0432\u043A\u043B\u044E\u0447\u0430\u044E\u0447\u0438 \u0432\u0456\u0434\u043A\u0440\u0438\u0442\u0456 \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u043D\u0456 \u0440\u043E\u0437\u0432'\u044F\u0437\u043A\u0438, \u0441\u0442\u043E\u044F\u043D\u043A\u0438, \u043F\u0435\u0440\u0435\u0445\u0440\u0435\u0441\u0442\u044F, \u043E\u0431'\u0457\u0437\u043D\u0456 \u0442\u0430 \u043E\u043A\u0440\u0443\u0436\u043D\u0456 \u0434\u043E\u0440\u043E\u0433\u0438), \u043D\u0430\u043F\u0440\u0438\u043A\u043B\u0430\u0434, \u043F\u0440\u043E\u0441\u043F\u0435\u043A\u0442\u0438, \u0430\u043B\u0435\u0457, \u043F\u0440\u043E\u0432\u0443\u043B\u043A\u0438, \u043E\u0431\u0445\u0456\u0434\u043D\u0456 \u0434\u043E\u0440\u043E\u0433\u0438, \u043F\u0456\u0434'\u0457\u0437\u043D\u0456 \u0434\u043E\u0440\u043E\u0433\u0438, \u043F\u043E\u043B\u044C\u043E\u0432\u0456 \u0434\u043E\u0440\u043E\u0433\u0438, \u0434\u043E\u0440\u0456\u0436\u043A\u0438 \u0434\u043B\u044F \u0432\u0435\u0440\u0445\u043E\u0432\u043E\u0457 \u0442\u0430 \u0432\u0435\u043B\u043E\u0441\u0438\u043F\u0435\u0434\u043D\u043E\u0457 \u0457\u0437\u0434\u0438, \u043C\u0430\u0439\u0434\u0430\u043D\u0438, \u0442\u0440\u043E\u0442\u0443\u0430\u0440\u0438 \u0442\u0430 \u043F\u0456\u0448\u043E\u0445\u0456\u0434\u043D\u0456 \u0437\u043E\u043D\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0441\u0442\u043E\u044F\u043D\u043E\u043A"
'2112.1': "\u0412\u0443\u043B\u0438\u0446\u0456 \u0442\u0430 \u0434\u043E\u0440\u043E\u0433\u0438 \u043C\u0456\u0441\u0442 \u0456 \u043D\u0430\u0441\u0435\u043B\u0435\u043D\u0438\u0445 \u043F\u0443\u043D\u043A\u0442\u0456\u0432"
'2112.2': "\u041F\u043E\u0437\u0430\u043C\u0456\u0441\u044C\u043A\u0456, \u043E\u0431'\u0457\u0437\u043D\u0456 \u0442\u0430 \u043E\u043A\u0440\u0443\u0436\u043D\u0456 \u0434\u043E\u0440\u043E\u0433\u0438"
'2112.3': "\u0414\u043E\u0440\u043E\u0433\u0438 \u0434\u043B\u044F \u0442\u0435\u0445\u043D\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u043E\u0433\u043E \u0430\u0432\u0442\u043E\u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0438\u0445 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432"
'2112.4': "\u0414\u043E\u0440\u0456\u0436\u043A\u0438 \u0434\u043B\u044F \u0432\u0435\u043B\u043E\u0441\u0438\u043F\u0435\u0434\u043D\u043E\u0457 \u0442\u0430 \u0432\u0435\u0440\u0445\u043E\u0432\u043E\u0457 \u0457\u0437\u0434\u0438"
'2112.5': "\u041C\u0430\u0439\u0434\u0430\u043D\u0438, \u0442\u0440\u043E\u0442\u0443\u0430\u0440\u0438 \u0442\u0430 \u043F\u0456\u0448\u043E\u0445\u0456\u0434\u043D\u0456 \u0437\u043E\u043D\u0438"
'2112.6': "\u041F\u043E\u043B\u044C\u043E\u0432\u0456 \u0434\u043E\u0440\u043E\u0433\u0438"
'2112.7': "\u0410\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u0456 \u0434\u043E\u0440\u043E\u0433\u0438 \u0441\u0456\u043B\u044C\u0441\u044C\u043A\u043E\u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u044C\u043A\u0438\u0445 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432"
'2112.8': "\u041F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0441\u0442\u043E\u044F\u043D\u043E\u043A \u043D\u0430 \u0432\u0443\u043B\u0438\u0446\u044F\u0445 \u0442\u0430 \u0434\u043E\u0440\u043E\u0433\u0430\u0445"
'2112.9': "\u0428\u043B\u044F\u0445\u0438, \u0432\u0443\u043B\u0438\u0446\u0456, \u0434\u043E\u0440\u043E\u0433\u0438 \u0442\u0430 \u0434\u043E\u0440\u043E\u0436\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0456\u043D\u0448\u0456"
'212': "\u0417\u0430\u043B\u0456\u0437\u043D\u0438\u0446\u0456"
'2121': "\u0417\u0430\u043B\u0456\u0437\u043D\u0438\u0446\u0456 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0456 \u043A\u043E\u043B\u0456\u0457 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456, \u0441\u0442\u0440\u0456\u043B\u043A\u0438, \u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0456 \u043F\u0435\u0440\u0435\u0457\u0437\u0434\u0438, \u0441\u0442\u0430\u043D\u0446\u0456\u0439\u043D\u0456 \u0442\u0430 \u0441\u043E\u0440\u0442\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u043A\u043E\u043B\u0456\u0457.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u0457.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0456 \u0432\u043E\u043A\u0437\u0430\u043B\u0438 (12.41)\u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u0456\u043D \u043C\u043E\u0441\u0442\u0438 (21.41)\u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0456 \u0442\u0443\u043D\u0435\u043B\u0456 (21.42)"
'2121.1': "\u0417\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0456 \u043A\u043E\u043B\u0456\u0457 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456"
'2121.2': "\u041F\u0456\u0434'\u0457\u0437\u043D\u0456, \u0441\u0442\u0430\u043D\u0446\u0456\u0439\u043D\u0456 \u0442\u0430 \u0441\u043E\u0440\u0442\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u043A\u043E\u043B\u0456\u0457"
'2121.3': "\u041F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u0457"
'2121.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0434\u043B\u044F \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0438\u0445 \u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0446\u044C \u0456\u043D\u0448\u0456"
'2122': "\u0417\u0430\u043B\u0456\u0437\u043D\u0438\u0446\u0456 \u043C\u0456\u0441\u0446\u0435\u0432\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0456 \u043A\u043E\u043B\u0456\u0457 \u043C\u0435\u0442\u0440\u043E\u043F\u043E\u043B\u0456\u0442\u0435\u043D\u0456\u0432 (\u043F\u0456\u0434\u0437\u0435\u043C\u043D\u0456, \u043D\u0430\u0437\u0435\u043C\u043D\u0456, \u043D\u0430\u0434\u0437\u0435\u043C\u043D\u0456)\u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0446\u0456 \u043F\u0456\u0434\u0432\u0456\u0441\u043D\u0456 \u0442\u0430 \u043D\u0430 \u0435\u0441\u0442\u0430\u043A\u0430\u0434\u0430\u0445, \u043C\u0456\u0441\u044C\u043A\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438 \u0434\u043E\u0440\u0456\u0433 \u0434\u043B\u044F \u0433\u0440\u043E\u043C\u0430\u0434\u0441\u044C\u043A\u043E\u0433\u043E \u0440\u0435\u0439\u043A\u043E\u0432\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443, \u043D\u0430\u043F\u0440\u0438\u043A\u043B\u0430\u0434, \u0442\u0440\u0430\u043C\u0432\u0430\u0439\u043D\u0456 \u043A\u043E\u043B\u0456\u0457.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u0457"
'2122.1': "\u0417\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0456 \u043A\u043E\u043B\u0456\u0457 \u043C\u0435\u0442\u0440\u043E\u043F\u043E\u043B\u0456\u0442\u0435\u043D\u0456\u0432"
'2122.2': "\u0422\u0440\u0430\u043C\u0432\u0430\u0439\u043D\u0456 \u043A\u043E\u043B\u0456\u0457"
'2122.3': "\u0417\u0430\u043B\u0456\u0437\u043D\u0438\u0446\u0456 \u043F\u0456\u0434\u0432\u0456\u0441\u043D\u0456 \u0442\u0430 \u043D\u0430 \u0435\u0441\u0442\u0430\u043A\u0430\u0434\u0430\u0445"
'2122.4': "\u0417\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0456 \u043A\u043E\u043B\u0456\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0438\u0445 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432"
'2122.5': "\u041F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u0457"
'2122.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043C\u0456\u0441\u0446\u0435\u0432\u043E\u0433\u043E \u0440\u0435\u0439\u043A\u043E\u0432\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443 \u0456\u043D\u0448\u0456"
'213': "\u0417\u043B\u0456\u0442\u043D\u043E-\u043F\u043E\u0441\u0430\u0434\u043A\u043E\u0432\u0456 \u0441\u043C\u0443\u0433\u0438"
'2130': "\u0417\u043B\u0456\u0442\u043D\u043E-\u043F\u043E\u0441\u0430\u0434\u043A\u043E\u0432\u0456 \u0441\u043C\u0443\u0433\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0437\u043B\u0456\u0442\u043D\u043E-\u043F\u043E\u0441\u0430\u0434\u043A\u043E\u0432\u0456 \u0441\u043C\u0443\u0433\u0438 \u0434\u043B\u044F \u0437\u043B\u0435\u0442\u0443, \u043F\u043E\u0441\u0430\u0434\u043A\u0438 \u0430\u0431\u043E \u043C\u0430\u043D\u0435\u0432\u0440\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u0441\u0442\u043E\u044F\u043D\u043A\u0438 \u043B\u0456\u0442\u0430\u043B\u044C\u043D\u0438\u0445 \u0430\u043F\u0430\u0440\u0430\u0442\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u0457.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0430\u0435\u0440\u043E\u0434\u0440\u043E\u043C\u0456\u0432 (12.41)"
'2130.1': "\u0417\u043B\u0456\u0442\u043D\u043E-\u043F\u043E\u0441\u0430\u0434\u043A\u043E\u0432\u0456 \u0441\u043C\u0443\u0433\u0438 \u0434\u043B\u044F \u0437\u043B\u0435\u0442\u0443 \u0442\u0430 \u043F\u043E\u0441\u0430\u0434\u043A\u0438"
'2130.2': "\u0417\u043B\u0456\u0442\u043D\u043E-\u043F\u043E\u0441\u0430\u0434\u043A\u043E\u0432\u0456 \u0441\u043C\u0443\u0433\u0438 \u0434\u043B\u044F \u043C\u0430\u043D\u0435\u0432\u0440\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u0441\u0442\u043E\u044F\u043D\u043A\u0438 \u043B\u0456\u0442\u0430\u043A\u0456\u0432 \u0442\u0430 \u0456\u043D\u0448\u0438\u0445 \u043B\u0456\u0442\u0430\u043B\u044C\u043D\u0438\u0445 \u0430\u043F\u0430\u0440\u0430\u0442\u0456\u0432"
'2130.3': "\u041F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u0457 \u0437\u043B\u0456\u0442\u043D\u043E-\u043F\u043E\u0441\u0430\u0434\u043A\u043E\u0432\u0438\u0445 \u0442\u0430 \u0441\u0442\u043E\u044F\u043D\u043A\u043E\u0432\u0438\u0445 \u0441\u043C\u0443\u0433"
'2130.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0434\u043B\u044F \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F \u0437\u043B\u0456\u0442\u043D\u043E-\u043F\u043E\u0441\u0430\u0434\u043A\u043E\u0432\u0438\u0445 \u0442\u0430 \u0441\u0442\u043E\u044F\u043D\u043A\u043E\u0432\u0438\u0445 \u0441\u043C\u0443\u0433 \u0456\u043D\u0448\u0456"
'214': "\u041C\u043E\u0441\u0442\u0438, \u0435\u0441\u0442\u0430\u043A\u0430\u0434\u0438, \u0442\u0443\u043D\u0435\u043B\u0456 \u0442\u0430 \u043C\u0435\u0442\u0440\u043E"
'2141': "\u041C\u043E\u0441\u0442\u0438 \u0442\u0430 \u0435\u0441\u0442\u0430\u043A\u0430\u0434\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0430\u0432\u0442\u043E\u0434\u043E\u0440\u043E\u0436\u043D\u0456 \u0442\u0430 \u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0456 \u043C\u043E\u0441\u0442\u0438 \u0437 \u043C\u0435\u0442\u0430\u043B\u0443, \u0437\u0430\u043B\u0456\u0437\u043E\u0431\u0435\u0442\u043E\u043D\u0443 \u0430\u0431\u043E \u0456\u043D\u0448\u0438\u0445 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432, \u0432\u043A\u043B\u044E\u0447\u0430\u044E\u0447\u0438 \u043A\u043E\u043D\u0441\u0442\u0440\u0443\u043A\u0446\u0456\u0457 \u0435\u0441\u0442\u0430\u043A\u0430\u0434.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043F\u0435\u0440\u0435\u0441\u0443\u0432\u043D\u0456 \u043C\u043E\u0441\u0442\u0438, \u0432\u0456\u0430\u0434\u0443\u043A\u0438, \u043C\u043E\u0441\u0442\u0438 \u043F\u043E\u043B\u044C\u043E\u0432\u0438\u0445 \u0434\u043E\u0440\u0456\u0433, \u043F\u0456\u0448\u043E\u0445\u0456\u0434\u043D\u0456 \u043C\u043E\u0441\u0442\u0438\u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u0457"
'2141.1': "\u0410\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u0456 \u043C\u043E\u0441\u0442\u0438, \u0448\u043B\u044F\u0445\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u0442\u0430 \u0435\u0441\u0442\u0430\u043A\u0430\u0434\u0438 \u043D\u0430\u0434\u0437\u0435\u043C\u043D\u0456"
'2141.2': "\u0417\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0456 \u043C\u043E\u0441\u0442\u0438 \u0442\u0430 \u0435\u0441\u0442\u0430\u043A\u0430\u0434\u0438 \u043D\u0430\u0434\u0437\u0435\u043C\u043D\u0456"
'2141.3': "\u041C\u043E\u0441\u0442\u0438 \u043A\u043E\u043C\u0431\u0456\u043D\u043E\u0432\u0430\u043D\u0456"
'2141.4': "\u041C\u043E\u0441\u0442\u0438 \u043F\u043E\u043B\u044C\u043E\u0432\u0438\u0445 \u0434\u043E\u0440\u0456\u0433"
'2141.5': "\u041C\u043E\u0441\u0442\u0438 \u043F\u0435\u0440\u0435\u0441\u0443\u0432\u043D\u0456, \u043D\u0430\u043F\u043B\u0430\u0432\u043D\u0456 \u0442\u0430 \u043F\u043E\u0440\u043E\u043C\u0438"
'2141.6': "\u041C\u043E\u0441\u0442\u0438 \u043F\u0456\u0448\u043E\u0445\u0456\u0434\u043D\u0456"
'2141.7': "\u041F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u0457 \u043C\u043E\u0441\u0442\u0456\u0432 \u0442\u0430 \u0435\u0441\u0442\u0430\u043A\u0430\u0434"
'2141.9': "\u041C\u043E\u0441\u0442\u0438 \u0442\u0430 \u0435\u0441\u0442\u0430\u043A\u0430\u0434\u0438 \u0456\u043D\u0448\u0456"
'2142': "\u0422\u0443\u043D\u0435\u043B\u0456 \u0442\u0430 \u043C\u0435\u0442\u0440\u043E.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0442\u0443\u043D\u0435\u043B\u0456 \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u0438\u0445 \u0434\u043E\u0440\u0456\u0433, \u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0446\u044C \u0442\u0430 \u043C\u0435\u0442\u0440\u043E\u043F\u043E\u043B\u0456\u0442\u0435\u043D\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u0457"
'2142.1': "\u0422\u0443\u043D\u0435\u043B\u0456 \u0430\u0432\u0442\u043E\u0434\u043E\u0440\u043E\u0436\u043D\u0456"
'2142.2': "\u0422\u0443\u043D\u0435\u043B\u0456 \u0437\u0430\u043B\u0456\u0437\u043D\u0438\u0447\u043D\u0456"
'2142.3': "\u0422\u0443\u043D\u0435\u043B\u0456 \u043A\u043E\u043C\u0431\u0456\u043D\u043E\u0432\u0430\u043D\u0456"
'2142.4': "\u0422\u0443\u043D\u0435\u043B\u0456 \u043C\u0435\u0442\u0440\u043E\u043F\u043E\u043B\u0456\u0442\u0435\u043D\u0456\u0432"
'2142.5': "\u0422\u0443\u043D\u0435\u043B\u0456 \u043F\u0456\u0448\u043E\u0445\u0456\u0434\u043D\u0456"
'2142.6': "\u041F\u0435\u0440\u0435\u0445\u043E\u0434\u0438 \u043F\u0456\u0434\u0437\u0435\u043C\u043D\u0456"
'2142.7': "\u041F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F, \u0441\u0438\u0433\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0457, \u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0431\u0435\u0437\u043F\u0435\u043A\u0438 \u0442\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u0457 \u0442\u0443\u043D\u0435\u043B\u0456\u0432 \u0442\u0430 \u043C\u0435\u0442\u0440\u043E"
'2142.9': "\u0422\u0443\u043D\u0435\u043B\u0456 \u0442\u0430 \u043F\u043E\u0434\u0456\u0431\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0456\u043D\u0448\u0456"
'215': "\u041F\u043E\u0440\u0442\u0438, \u043A\u0430\u043D\u0430\u043B\u0438, \u0433\u0440\u0435\u0431\u043B\u0456 \u0442\u0430 \u0456\u043D\u0448\u0456 \u0432\u043E\u0434\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438"
'2151': "\u041F\u043E\u0440\u0442\u0438 \u0442\u0430 \u0441\u0443\u0434\u043D\u043E\u043F\u043B\u0430\u0432\u043D\u0456 \u043A\u0430\u043D\u0430\u043B\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u043E\u0440\u0441\u044C\u043A\u0456 \u0442\u0430 \u0440\u0456\u0447\u043A\u043E\u0432\u0456 \u043F\u043E\u0440\u0442\u043E\u0432\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 (\u043F\u0440\u0438\u0447\u0430\u043B\u0438, \u0434\u043E\u043A\u0438, \u043F\u0440\u0438\u0441\u0442\u0430\u043D\u0456, \u043C\u043E\u043B\u0438 \u0442\u043E\u0449\u043E)\u0441\u0443\u0434\u043D\u043E\u043F\u043B\u0430\u0432\u043D\u0456 \u043A\u0430\u043D\u0430\u043B\u0438\u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u043D\u0430 \u0440\u0456\u043A\u0430\u0445 \u0442\u0430 \u043A\u0430\u043D\u0430\u043B\u0430\u0445 (\u0448\u043B\u044E\u0437\u0438, \u043C\u043E\u0441\u0442\u0438-\u043A\u0430\u043D\u0430\u043B\u0438, \u0442\u0443\u043D\u0435\u043B\u0456-\u043A\u0430\u043D\u0430\u043B\u0438, \u043E\u0431\u043B\u0430\u0434\u043D\u0430\u043D\u043D\u044F \u0431\u0435\u0440\u0435\u0433\u0456\u0432)\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0456 \u043F\u043E\u0440\u0442\u0438\u0432\u043E\u0434\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0441\u0443\u0434\u043D\u043E\u0431\u0443\u0434\u0456\u0432\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456 (\u0441\u0442\u0430\u043F\u0435\u043B\u0456, \u043A\u0430\u043C\u0435\u0440\u0438, \u0431\u0430\u0441\u0435\u0439\u043D\u0438 \u0442\u0430 \u0442. \u0456\u043D.).\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u043C\u0430\u044F\u043A\u0456\u0432 (12.41)\u0434\u0430\u043C\u0431\u0438 \u0442\u0430 \u043F\u043E\u0434\u0456\u0431\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0434\u043B\u044F \u0443\u0442\u0440\u0438\u043C\u0430\u043D\u043D\u044F \u0432\u043E\u0434\u0438 (21.52)\u0431\u0435\u0440\u0435\u0433\u043E\u0432\u0456 \u0442\u0430 \u043F\u0440\u0438\u0431\u0435\u0440\u0435\u0436\u043D\u0456 \u043D\u0430\u0444\u0442\u043E\u0432\u0456 \u0442\u0435\u0440\u043C\u0456\u043D\u0430\u043B\u0438 (23.03)"
'2151.1': "\u041F\u043E\u0440\u0442\u043E\u0432\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u043C\u043E\u0440\u0441\u044C\u043A\u0456"
'2151.2': "\u041F\u043E\u0440\u0442\u043E\u0432\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0440\u0456\u0447\u043A\u043E\u0432\u0456"
'2151.3': "\u041A\u0430\u043D\u0430\u043B\u0438 \u0441\u0443\u0434\u043D\u043E\u043F\u043B\u0430\u0432\u043D\u0456"
'2151.4': "\u0428\u043B\u044E\u0437\u0438 \u0442\u0430 \u0456\u043D\u0448\u0456 \u0441\u0443\u0434\u043D\u043E\u043F\u043B\u0430\u0432\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u043D\u0430 \u0440\u0456\u0447\u043A\u0430\u0445 \u0456 \u043A\u0430\u043D\u0430\u043B\u0430\u0445"
'2151.5': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0441\u0443\u0434\u043D\u043E\u0431\u0443\u0434\u0456\u0432\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
'2151.6': "\u041F\u043E\u0440\u0442\u0438 \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0456"
'2151.9': "\u041F\u043E\u0440\u0442\u043E\u0432\u0456 \u0442\u0430 \u0441\u0443\u0434\u043D\u043E\u043F\u043B\u0430\u0432\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0456\u043D\u0448\u0456"
'2152': "\u0414\u0430\u043C\u0431\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0434\u0430\u043C\u0431\u0438 \u0442\u0430 \u043F\u043E\u0434\u0456\u0431\u043D\u0456 \u0432\u043E\u0434\u043E\u0437\u0430\u0445\u0438\u0441\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0442\u0430\u043A\u0438\u0445 \u0433\u0430\u043B\u0443\u0437\u0435\u0439, \u044F\u043A \u0433\u0456\u0434\u0440\u043E\u0435\u043D\u0435\u0440\u0433\u0435\u0442\u0438\u043A\u0430, \u0437\u0440\u043E\u0448\u0435\u043D\u043D\u044F, \u0440\u0435\u0433\u0443\u043B\u044E\u0432\u0430\u043D\u043D\u044F \u0432\u043E\u0434\u043D\u0438\u0445 \u043F\u043E\u0442\u043E\u043A\u0456\u0432, \u0437\u0430\u0445\u0438\u0441\u0442 \u0432\u0456\u0434 \u043F\u0430\u0432\u043E\u0434\u043A\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0437\u0430\u0445\u0438\u0441\u043D\u0456 \u0434\u0430\u043C\u0431\u0438, \u0437\u0430\u0433\u0430\u0442\u0438, \u0437\u0430\u0445\u0438\u0441\u043D\u0456 \u043D\u0430\u0441\u0438\u043F\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0448\u043B\u044E\u0437\u0438 (21.51)\u0433\u0456\u0434\u0440\u043E\u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0456\u0457 (23.02)"
'2152.1': "\u0414\u0430\u043C\u0431\u0438 \u0433\u0456\u0434\u0440\u043E\u0435\u043D\u0435\u0440\u0433\u0435\u0442\u0438\u0447\u043D\u0456"
'2152.2': "\u0414\u0430\u043C\u0431\u0438 \u0434\u043B\u044F \u0437\u0440\u043E\u0448\u0435\u043D\u043D\u044F \u0456 \u0440\u0435\u0433\u0443\u043B\u044E\u0432\u0430\u043D\u043D\u044F \u0432\u043E\u0434\u043D\u0438\u0445 \u043F\u043E\u0442\u043E\u043A\u0456\u0432"
'2152.3': "\u0412\u043E\u0434\u043E\u0437\u0430\u0445\u0438\u0441\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0442\u0435\u043F\u043B\u043E\u0432\u0438\u0445 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0456\u0439"
'2152.4': "\u0412\u043E\u0434\u043E\u0437\u0430\u0445\u0438\u0441\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0430\u0442\u043E\u043C\u043D\u0438\u0445 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0456\u0439"
'2152.5': "\u0414\u0430\u043C\u0431\u0438, \u0437\u0430\u0433\u0430\u0442\u0438 \u0442\u0430 \u0456\u043D\u0448\u0456 \u0432\u043E\u0434\u043E\u0437\u0430\u0445\u0438\u0441\u043D\u0456 \u043D\u0430\u0441\u0438\u043F\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438"
'2153': "\u0410\u043A\u0432\u0435\u0434\u0443\u043A\u0438, \u0437\u0440\u043E\u0448\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u0442\u0430 \u043E\u0441\u0443\u0448\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0437\u0440\u043E\u0448\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u043A\u0430\u043D\u0430\u043B\u0438 \u0442\u0430 \u0456\u043D\u0448\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438, \u0449\u043E \u043F\u043E\u0441\u0442\u0430\u0447\u0430\u044E\u0442\u044C \u0432\u043E\u0434\u0443 \u0443 \u0437\u0435\u043C\u043B\u0435\u0440\u043E\u0431\u0441\u0442\u0432\u0456\u0430\u043A\u0432\u0435\u0434\u0443\u043A\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0434\u0440\u0435\u043D\u0430\u0436\u043D\u0456 \u0442\u0430 \u0437\u043B\u0438\u0432\u043E\u0432\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0430\u043A\u0432\u0435\u0434\u0443\u043A\u0438, \u0449\u043E \u0454 \u0456\u0441\u0442\u043E\u0440\u0438\u0447\u043D\u0438\u043C\u0438 \u043F\u0430\u043C'\u044F\u0442\u043A\u0430\u043C\u0438 (12.73)\u0434\u0430\u043C\u0431\u0438 (21.52)\u0432\u043E\u0434\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 (22.12, 22.22)"
'2153.1': "\u0410\u043A\u0432\u0435\u0434\u0443\u043A\u0438, \u0434\u044E\u043A\u0435\u0440\u0438"
'2153.2': "\u041A\u0430\u043D\u0430\u043B\u0438 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u0437\u0440\u043E\u0448\u0443\u0432\u0430\u043B\u044C\u043D\u0438\u0445 \u0441\u0438\u0441\u0442\u0435\u043C"
'2153.3': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0441\u0438\u0441\u0442\u0435\u043C \u0432\u043E\u0434\u043E\u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0437\u0435\u043C\u043B\u0435\u0440\u043E\u0431\u0441\u0442\u0432\u0430"
'2153.4': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043E\u0441\u0443\u0448\u0443\u0432\u0430\u043B\u044C\u043D\u0438\u0445 \u0441\u0438\u0441\u0442\u0435\u043C"
'2153.5': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0437\u043B\u0438\u0432\u043E\u0432\u0438\u0445 \u043C\u0435\u0440\u0435\u0436"
'2153.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0437\u0440\u043E\u0448\u0443\u0432\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0442\u0430 \u043E\u0441\u0443\u0448\u0443\u0432\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0433\u043E\u0441\u043F\u043E\u0434\u0430\u0440\u0441\u0442\u0432\u0430 \u0456\u043D\u0448\u0456"
'22': "\u0422\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438, \u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0457 \u0442\u0430 \u043B\u0456\u043D\u0456\u0457 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043F\u0435\u0440\u0435\u0434\u0430\u0447\u0456"
'221': "\u041C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438, \u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0457 \u0442\u0430 \u043B\u0456\u043D\u0456\u0457 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043F\u0435\u0440\u0435\u0434\u0430\u0447\u0456"
'2211': "\u041C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u043D\u0430\u0444\u0442\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u0442\u0430 \u0433\u0430\u0437\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u043D\u0430\u0434\u0437\u0435\u043C\u043D\u0456, \u043F\u0456\u0434\u0437\u0435\u043C\u043D\u0456 \u0430\u0431\u043E \u043F\u0456\u0434\u0432\u043E\u0434\u043D\u0456 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u0434\u043B\u044F \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443\u0432\u0430\u043D\u043D\u044F \u043D\u0430\u0444\u0442\u043E\u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 \u0442\u0430 \u0433\u0430\u0437\u0443.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043D\u0430\u0441\u043E\u0441\u043D\u0456 \u0441\u0442\u0430\u043D\u0446\u0456\u0457.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0432\u043E\u0434\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 (22.12, 22.22)\u043C\u0456\u0441\u044C\u043A\u0456 \u0433\u0430\u0437\u043E\u0432\u0456 \u043C\u0435\u0440\u0435\u0436\u0456 (22.21)\u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0434\u043B\u044F \u0437\u0430\u0432\u0430\u043D\u0442\u0430\u0436\u0435\u043D\u043D\u044F \u0442\u0430 \u0437\u0431\u0435\u0440\u0456\u0433\u0430\u043D\u043D\u044F \u043D\u0430\u0444\u0442\u043E\u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 (23.03)"
'2211.1': "\u041D\u0430\u0444\u0442\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456"
'2211.2': "\u0413\u0430\u0437\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456"
'2211.3': "\u041A\u043E\u043D\u0434\u0435\u043D\u0441\u0430\u0442\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u0442\u0430 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456"
'2211.4': "\u041D\u0430\u0441\u043E\u0441\u043D\u0456 \u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u043D\u0430 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0438\u0445 \u043D\u0430\u0444\u0442\u043E- \u0442\u0430 \u0433\u0430\u0437\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0430\u0445"
'2211.5': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0437\u0432'\u044F\u0437\u043A\u0443 \u043D\u0430 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0438\u0445 \u043D\u0430\u0444\u0442\u043E- \u0442\u0430 \u0433\u0430\u0437\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0430\u0445"
'2211.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0434\u043B\u044F \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u0456\u0434\u043D\u043E\u0433\u043E \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443 \u0456\u043D\u0448\u0456"
'2212': "\u041C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u0432\u043E\u0434\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u043D\u0430\u0434\u0437\u0435\u043C\u043D\u0456, \u043F\u0456\u0434\u0437\u0435\u043C\u043D\u0456 \u0430\u0431\u043E \u043F\u0456\u0434\u0432\u043E\u0434\u043D\u0456 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u0434\u043B\u044F \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443\u0432\u0430\u043D\u043D\u044F \u0432\u043E\u0434\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043D\u0430\u0441\u043E\u0441\u043D\u0456, \u0444\u0456\u043B\u044C\u0442\u0440\u0430\u0446\u0456\u0439\u043D\u0456 \u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0442\u0430 \u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u043F\u043E \u0432\u0456\u0434\u0432\u0435\u0434\u0435\u043D\u043D\u044E \u0432\u043E\u0434\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0437\u0440\u043E\u0448\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u043A\u0430\u043D\u0430\u043B\u0438 \u0442\u0430 \u0430\u043A\u0432\u0435\u0434\u0443\u043A\u0438 (21.53)\u043C\u0456\u0441\u0446\u0435\u0432\u0456 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u0434\u043B\u044F \u0432\u043E\u0434\u0438 (22.22)"
'2212.1': "\u0412\u043E\u0434\u043E\u0432\u043E\u0434\u0438 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u0442\u0430 \u0432\u0456\u0434\u0432\u043E\u0434\u0438 \u0432\u0456\u0434 \u043D\u0438\u0445"
'2212.2': "\u0421\u0442\u0430\u043D\u0446\u0456\u0457 \u043D\u0430\u0441\u043E\u0441\u043D\u0456 \u0442\u0430 \u0444\u0456\u043B\u044C\u0442\u0440\u0430\u0446\u0456\u0439\u043D\u0456 \u043D\u0430 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0438\u0445 \u0432\u043E\u0434\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0430\u0445"
'2212.3': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0437\u0432'\u044F\u0437\u043A\u0443 \u0442\u0430 \u043E\u0431\u0441\u043B\u0443\u0433\u043E\u0432\u0443\u0432\u0430\u043D\u043D\u044F \u043D\u0430 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0438\u0445 \u0432\u043E\u0434\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0430\u0445"
'2213': "\u041C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439\u043D\u0456 \u043B\u0456\u043D\u0456\u0457.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u043D\u0430\u0434\u0437\u0435\u043C\u043D\u0456, \u043F\u0456\u0434\u0437\u0435\u043C\u043D\u0456 \u0430\u0431\u043E \u043F\u0456\u0434\u0432\u043E\u0434\u043D\u0456 \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439\u043D\u0456 \u043B\u0456\u043D\u0456\u0457, \u0440\u0435\u043B\u0435\u0439\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438 \u0440\u0430\u0434\u0456\u043E \u0456 \u0442\u0435\u043B\u0435\u0431\u0430\u0447\u0435\u043D\u043D\u044F \u0442\u0430 \u043A\u0430\u0431\u0435\u043B\u044C\u043D\u0456 \u043C\u0435\u0440\u0435\u0436\u0456, \u0440\u0435\u043B\u0435\u0439\u043D\u0456 \u0432\u0438\u0448\u043A\u0438 \u0442\u0430 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0434\u043B\u044F \u0440\u0430\u0434\u0456\u043E\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u043B\u0456\u043D\u0456\u0457 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043F\u0435\u0440\u0435\u0434\u0430\u0447\u0456 (22.14)\u043C\u0456\u0441\u044C\u043A\u0456 \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439\u043D\u0456 \u043C\u0435\u0440\u0435\u0436\u0456 (22.24)"
'2213.1': "\u041B\u0456\u043D\u0456\u0457 \u0442\u0430 \u0432\u0443\u0437\u043B\u0438 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u0442\u0435\u043B\u0435\u0444\u043E\u043D\u043D\u043E\u0433\u043E \u0437\u0432'\u044F\u0437\u043A\u0443"
'2213.2': "\u0420\u0435\u043B\u0435\u0439\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438 \u0442\u0435\u043B\u0435\u0431\u0430\u0447\u0435\u043D\u043D\u044F \u0442\u0430 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u043A\u0430\u0431\u0435\u043B\u044C\u043D\u0456 \u043C\u0435\u0440\u0435\u0436\u0456"
'2213.3': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0442\u0430 \u0441\u0438\u0441\u0442\u0435\u043C\u0438 \u0440\u0430\u0434\u0456\u043E\u0437\u0432'\u044F\u0437\u043A\u0443"
'2213.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439 \u0456\u043D\u0448\u0456"
'2214': "\u041C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u043B\u0456\u043D\u0456\u0457 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043F\u0435\u0440\u0435\u0434\u0430\u0447\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0447\u043D\u0456 \u043B\u0456\u043D\u0456\u0457 (\u043F\u043E\u0432\u0456\u0442\u0440\u044F\u043D\u0456 \u0430\u0431\u043E \u043F\u0456\u0434\u0437\u0435\u043C\u043D\u0456) \u0432\u0438\u0441\u043E\u043A\u043E\u0457 \u043D\u0430\u043F\u0440\u0443\u0433\u0438 \u0430\u0431\u043E \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0447\u043D\u0456 \u0440\u043E\u0437\u043F\u043E\u0434\u0456\u043B\u044C\u043D\u0456 \u043B\u0456\u043D\u0456\u0457 \u0441\u0435\u0440\u0435\u0434\u043D\u044C\u043E\u0457 \u043D\u0430\u043F\u0440\u0443\u0433\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0442\u0440\u0430\u043D\u0441\u0444\u043E\u0440\u043C\u0430\u0442\u043E\u0440\u043D\u0456 \u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0442\u0430 \u043F\u0456\u0434\u0441\u0442\u0430\u043D\u0446\u0456\u0457, \u043E\u043F\u043E\u0440\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0441\u0438\u0441\u0442\u0435\u043C\u0438 \u043E\u0441\u0432\u0456\u0442\u043B\u0435\u043D\u043D\u044F \u0434\u043E\u0440\u0456\u0433 (21.11, 21.12)\u043C\u0456\u0441\u0446\u0435\u0432\u0456 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0447\u043D\u0456 \u0440\u043E\u0437\u043F\u043E\u0434\u0456\u043B\u044C\u043D\u0456 \u043B\u0456\u043D\u0456\u0457 \u0442\u0430 \u0434\u043E\u043F\u043E\u043C\u0456\u0436\u043D\u0456 \u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 (22.24)"
'2214.1': "\u041C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u043B\u0456\u043D\u0456\u0457 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043F\u0435\u0440\u0435\u0434\u0430\u0447\u0456 \u043A\u0430\u0431\u0435\u043B\u044C\u043D\u0456 - \u041A\u041B\u0415\u041F \u0432\u0438\u0441\u043E\u043A\u043E\u0457 \u043D\u0430\u043F\u0440\u0443\u0433\u0438"
'2214.2': "\u041C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0456 \u043B\u0456\u043D\u0456\u0457 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043F\u0435\u0440\u0435\u0434\u0430\u0447\u0456 \u043F\u043E\u0432\u0456\u0442\u0440\u044F\u043D\u0456 - \u041B\u0415\u041F \u0432\u0438\u0441\u043E\u043A\u043E\u0457 \u043D\u0430\u043F\u0440\u0443\u0433\u0438"
'2214.3': "\u041B\u0456\u043D\u0456\u0457 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0447\u043D\u0456 \u0440\u043E\u0437\u043F\u043E\u0434\u0456\u043B\u044C\u043D\u0456 \u0441\u0435\u0440\u0435\u0434\u043D\u044C\u043E\u0457 \u043D\u0430\u043F\u0440\u0443\u0433\u0438"
'2214.4': "\u0422\u0440\u0430\u043D\u0441\u0444\u043E\u0440\u043C\u0430\u0442\u043E\u0440\u043D\u0456 \u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0442\u0430 \u043F\u0456\u0434\u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0438\u0445 \u043B\u0456\u043D\u0456\u0439 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043F\u0435\u0440\u0435\u0434\u0430\u0447\u0456"
'2214.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043C\u0430\u0433\u0456\u0441\u0442\u0440\u0430\u043B\u044C\u043D\u0438\u0445 \u0441\u0438\u0441\u0442\u0435\u043C \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0437\u0430\u0431\u0435\u0437\u043F\u0435\u0447\u0435\u043D\u043D\u044F \u0456\u043D\u0448\u0456"
'222': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u0442\u0430 \u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0457"
'2221': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u0433\u0430\u0437\u043E\u0440\u043E\u0437\u043F\u043E\u0434\u0456\u043B\u044C\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u0456\u0441\u0446\u0435\u0432\u0456 \u043D\u0430\u0434\u0437\u0435\u043C\u043D\u0456 \u0442\u0430 \u043F\u0456\u0434\u0437\u0435\u043C\u043D\u0456 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u0434\u043B\u044F \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443\u0432\u0430\u043D\u043D\u044F \u0433\u0430\u0437\u0443"
'2221.1': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u0434\u043B\u044F \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443\u0432\u0430\u043D\u043D\u044F \u0433\u0430\u0437\u0443"
'2221.2': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0434\u043E\u043F\u043E\u043C\u0456\u0436\u043D\u0456 \u043C\u0456\u0441\u0446\u0435\u0432\u0438\u0445 \u0433\u0430\u0437\u043E\u0440\u043E\u0437\u043F\u043E\u0434\u0456\u043B\u044C\u043D\u0438\u0445 \u0441\u0438\u0441\u0442\u0435\u043C"
'2222': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u0456\u0434\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438 \u0434\u043B\u044F \u0432\u043E\u0434\u0438 \u0442\u0430 \u0456\u043D\u0448\u0438\u0445 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u0456\u0441\u0446\u0435\u0432\u0456 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u043E\u0434\u0438 \u0434\u043B\u044F \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443\u0432\u0430\u043D\u043D\u044F \u0432\u043E\u0434\u0438, \u043F\u0430\u0440\u0438 \u0430\u0431\u043E \u0441\u0442\u0438\u0441\u043D\u0435\u043D\u043E\u0433\u043E \u043F\u043E\u0432\u0456\u0442\u0440\u044F.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0432\u043E\u0434\u043E\u043D\u0430\u043F\u0456\u0440\u043D\u0456 \u0431\u0430\u0448\u0442\u0438, \u043A\u043E\u043B\u043E\u0434\u044F\u0437\u0456, \u0444\u043E\u043D\u0442\u0430\u043D\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0437\u0440\u043E\u0448\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 (21.53)\u0432\u043E\u0434\u043E\u043E\u0447\u0438\u0441\u043D\u0456 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 (22.23)"
'2222.1': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u0432\u043E\u0434\u043E\u043F\u0440\u043E\u0432\u0456\u0434\u043D\u0456 \u043C\u0435\u0440\u0435\u0436\u0456"
'2222.2': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u0442\u0435\u043F\u043B\u043E\u0432\u0456 \u043C\u0435\u0440\u0435\u0436\u0456"
'2222.3': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u043C\u0435\u0440\u0435\u0436\u0456 \u0434\u043B\u044F \u0442\u0440\u0430\u043D\u0441\u043F\u043E\u0440\u0442\u0443\u0432\u0430\u043D\u043D\u044F \u043F\u0430\u0440\u0438 \u0442\u0430 \u0441\u0442\u0438\u0441\u043D\u0435\u043D\u043E\u0433\u043E \u043F\u043E\u0432\u0456\u0442\u0440\u044F"
'2222.4': "\u0412\u043E\u0434\u044F\u043D\u0456 \u0441\u0432\u0435\u0440\u0434\u043B\u043E\u0432\u0438\u043D\u0438, \u043A\u043E\u043B\u043E\u0434\u044F\u0437\u0456, \u0431\u044E\u0432\u0435\u0442\u0438"
'2222.5': "\u0412\u043E\u0434\u043E\u043D\u0430\u043F\u0456\u0440\u043D\u0456 \u0431\u0430\u0448\u0442\u0438, \u0444\u043E\u043D\u0442\u0430\u043D\u0438"
'2222.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043C\u0456\u0441\u0446\u0435\u0432\u0438\u0445 \u0442\u0440\u0443\u0431\u043E\u043F\u0440\u043E\u0432\u0456\u0434\u043D\u0438\u0445 \u0441\u0438\u0441\u0442\u0435\u043C \u0456\u043D\u0448\u0456"
'2223': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u043A\u0430\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0439\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0432\u043E\u0434\u043E\u0441\u0442\u0456\u0447\u043D\u0456 \u043C\u0435\u0440\u0435\u0436\u0456 \u0442\u0430 \u043A\u0430\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0439\u043D\u0456 \u043A\u043E\u043B\u0435\u043A\u0442\u043E\u0440\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 \u0434\u043B\u044F \u043F\u0435\u0440\u0435\u0440\u043E\u0431\u043B\u0435\u043D\u043D\u044F \u0441\u0442\u0456\u0447\u043D\u0438\u0445 \u0432\u043E\u0434"
'2223.1': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u043A\u0430\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0439\u043D\u0456 \u0442\u0430 \u0432\u043E\u0434\u043E\u0441\u0442\u0456\u0447\u043D\u0456 \u043C\u0435\u0440\u0435\u0436\u0456"
'2223.2': "\u041A\u043E\u043B\u0435\u043A\u0442\u043E\u0440\u0438 \u043A\u0430\u043D\u0430\u043B\u0456\u0437\u0430\u0446\u0456\u0439\u043D\u0456"
'2223.3': "\u0423\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 \u0434\u043B\u044F \u043F\u0435\u0440\u0435\u0440\u043E\u0431\u043B\u0435\u043D\u043D\u044F \u0441\u0442\u0456\u0447\u043D\u0438\u0445 \u0432\u043E\u0434"
'2224': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u0435\u043B\u0435\u043A\u0442\u0440\u043E- \u0442\u0430 \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439\u043D\u0456 \u0441\u0438\u0441\u0442\u0435\u043C\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043C\u0456\u0441\u0446\u0435\u0432\u0456 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043C\u0435\u0440\u0435\u0436\u0456 \u0456 \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439\u043D\u0456 \u043B\u0456\u043D\u0456\u0457 (\u043F\u043E\u0432\u0456\u0442\u0440\u044F\u043D\u0456 \u0430\u0431\u043E \u043F\u0456\u0434\u0437\u0435\u043C\u043D\u0456) \u0442\u0430 \u0434\u043E\u043F\u043E\u043C\u0456\u0436\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 (\u0442\u0440\u0430\u043D\u0441\u0444\u043E\u0440\u043C\u0430\u0442\u043E\u0440\u043D\u0456 \u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0456 \u043F\u0456\u0434\u0441\u0442\u0430\u043D\u0446\u0456\u0457, \u0442\u0435\u043B\u0435\u0433\u0440\u0430\u0444\u043D\u0456 \u0441\u0442\u043E\u0432\u043F\u0438 \u0442\u0430 \u0442. \u0456\u043D.).\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043C\u0456\u0441\u0446\u0435\u0432\u0456 \u0442\u0435\u043B\u0435\u0432\u0456\u0437\u0456\u0439\u043D\u0456 \u043A\u0430\u0431\u0435\u043B\u044C\u043D\u0456 \u043C\u0435\u0440\u0435\u0436\u0456 \u0442\u0430 \u043A\u043E\u043B\u0435\u043A\u0442\u0438\u0432\u043D\u0456 \u0430\u043D\u0442\u0435\u043D\u0438"
'2224.1': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0438\u043B\u043E\u0432\u0456 \u043C\u0435\u0440\u0435\u0436\u0456"
'2224.2': "\u0422\u0440\u043E\u043B\u0435\u0439\u0431\u0443\u0441\u043D\u0456 \u043B\u0456\u043D\u0456\u0457"
'2224.3': "\u0422\u0440\u0430\u043D\u0441\u0444\u043E\u0440\u043C\u0430\u0442\u043E\u0440\u043D\u0456 \u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0442\u0430 \u043F\u0456\u0434\u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u043C\u0456\u0441\u0446\u0435\u0432\u0438\u0445 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043C\u0435\u0440\u0435\u0436"
'2224.4': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439\u043D\u0456 \u043B\u0456\u043D\u0456\u0457"
'2224.5': "\u041C\u0456\u0441\u0446\u0435\u0432\u0456 \u0442\u0435\u043B\u0435\u0432\u0456\u0437\u0456\u0439\u043D\u0456 \u043A\u0430\u0431\u0435\u043B\u044C\u043D\u0456 \u043C\u0435\u0440\u0435\u0436\u0456"
'2224.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043C\u0456\u0441\u0446\u0435\u0432\u0438\u0445 \u0435\u043B\u0435\u043A\u0442\u0440\u0438\u0447\u043D\u0438\u0445 \u0442\u0430 \u0442\u0435\u043B\u0435\u043A\u043E\u043C\u0443\u043D\u0456\u043A\u0430\u0446\u0456\u0439\u043D\u0438\u0445 \u043C\u0435\u0440\u0435\u0436 \u0456\u043D\u0448\u0456"
'23': "\u041A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u043D\u0456 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438"
'230': "\u041A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u043D\u0456 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438.\u0426\u044F \u0433\u0440\u0443\u043F\u0430 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043A\u043E\u043C\u043F\u043B\u0435\u043A\u0441\u043D\u0456 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 (\u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0456\u0457, \u0437\u0431\u0430\u0433\u0430\u0447\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u0444\u0430\u0431\u0440\u0438\u043A\u0438 \u0442\u043E\u0449\u043E), \u0449\u043E \u043D\u0435 \u043C\u0430\u044E\u0442\u044C \u0445\u0430\u0440\u0430\u043A\u0442\u0435\u0440\u043D\u0438\u0445 \u043E\u0437\u043D\u0430\u043A \u0431\u0443\u0434\u0438\u043D\u043A\u0456\u0432"
'2301': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0433\u0456\u0440\u043D\u0438\u0447\u043E\u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0438\u0445 \u0442\u0430 \u0434\u043E\u0431\u0443\u0432\u043D\u0438\u0445 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 \u0442\u0430 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0434\u043B\u044F \u0448\u0430\u0445\u0442, \u0432\u0438\u0434\u043E\u0431\u0443\u0432\u0430\u043D\u043D\u044F \u0432\u0443\u0433\u043B\u0435\u0432\u043E\u0434\u043D\u0435\u0432\u0438\u0445 \u043F\u043E\u043A\u043B\u0430\u0434\u0456\u0432, \u0440\u043E\u0437\u0440\u043E\u0431\u043A\u0438 \u0433\u0456\u0440\u0441\u044C\u043A\u0438\u0445 \u043F\u043E\u0440\u0456\u0434, \u0434\u043E\u0431\u0443\u0432\u0430\u043D\u043D\u044F, \u043F\u0435\u0440\u0435\u0440\u043E\u0431\u043B\u0435\u043D\u043D\u044F \u0442\u0430 \u0437\u0431\u0430\u0433\u0430\u0447\u0435\u043D\u043D\u044F \u0440\u0443\u0434\u043D\u043E\u0457 \u0441\u0438\u0440\u043E\u0432\u0438\u043D\u0438, \u0433\u0440\u0430\u0432\u0456\u0439\u043D\u0438\u0445 \u043A\u0430\u0440'\u0454\u0440\u0456\u0432 \u0442\u0430 \u0442. \u0456\u043D. (\u043D\u0430\u043F\u0440\u0438\u043A\u043B\u0430\u0434, \u0437\u0430\u0432\u0430\u043D\u0442\u0430\u0436\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u0442\u0430 \u0440\u043E\u0437\u0432\u0430\u043D\u0442\u0430\u0436\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u0441\u0442\u0430\u043D\u0446\u0456\u0457, \u043A\u043E\u043F\u0440\u0438 \u0448\u0430\u0445\u0442 \u0442\u0430 \u0442. \u0456\u043D.)\u0433\u0456\u043F\u0441\u043E\u0432\u0456, \u0446\u0435\u043C\u0435\u043D\u0442\u043D\u0456, \u0446\u0435\u0433\u0435\u043B\u044C\u043D\u0456, \u0447\u0435\u0440\u0435\u043F\u0438\u0447\u043D\u0456 \u0437\u0430\u0432\u043E\u0434\u0438 \u0442\u0430 \u0442. \u0456\u043D.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043B\u0456\u0441\u043E\u0437\u0430\u0433\u043E\u0442\u0456\u0432\u0435\u043B\u044C\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043E\u0444\u0456\u0441\u043D\u0456 \u0431\u0443\
  \u0434\u0456\u0432\u043B\u0456 (12.20)\u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0447\u0456 \u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0437\u0430\u0432\u043E\u0434\u0456\u0432, \u043C\u0430\u0439\u0441\u0442\u0435\u0440\u0435\u043D\u044C \u0437 \u0434\u0430\u0445\u043E\u043C (12.51)"
'2301.1': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043D\u0430\u0444\u0442\u043E\u0434\u043E\u0431\u0443\u0432\u043D\u043E\u0457 \u0442\u0430 \u0433\u0430\u0437\u043E\u0432\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
'2301.2': "\u0428\u0430\u0445\u0442\u0438 \u0442\u0430 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0437 \u0434\u043E\u0431\u0443\u0432\u0430\u043D\u043D\u044F \u0432\u0443\u0433\u0456\u043B\u043B\u044F \u0442\u0430 \u0441\u043B\u0430\u043D\u0446\u044E"
'2301.3': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0442\u043E\u0440\u0444'\u044F\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
'2301.4': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0437 \u0434\u043E\u0431\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u0437\u0431\u0430\u0433\u0430\u0447\u0435\u043D\u043D\u044F \u0440\u0443\u0434\u043D\u043E\u0457 \u0441\u0438\u0440\u043E\u0432\u0438\u043D\u0438 \u0434\u043B\u044F \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430 \u0447\u043E\u0440\u043D\u0438\u0445 \u043C\u0435\u0442\u0430\u043B\u0456\u0432"
'2301.5': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0437 \u0434\u043E\u0431\u0443\u0432\u0430\u043D\u043D\u044F \u0442\u0430 \u0437\u0431\u0430\u0433\u0430\u0447\u0435\u043D\u043D\u044F \u0440\u0443\u0434\u043D\u043E\u0457 \u0441\u0438\u0440\u043E\u0432\u0438\u043D\u0438 \u0434\u043B\u044F \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430 \u043A\u043E\u043B\u044C\u043E\u0440\u043E\u0432\u0438\u0445 \u043C\u0435\u0442\u0430\u043B\u0456\u0432"
'2301.6': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0437 \u0434\u043E\u0431\u0443\u0432\u0430\u043D\u043D\u044F \u0440\u0456\u0434\u043A\u0456\u0441\u043D\u0438\u0445 \u0456 \u0434\u043E\u0440\u043E\u0433\u043E\u0446\u0456\u043D\u043D\u0438\u0445 \u043C\u0435\u0442\u0430\u043B\u0456\u0432 \u0442\u0430 \u0430\u043B\u043C\u0430\u0437\u0456\u0432"
'2301.7': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430 \u0431\u0443\u0434\u0456\u0432\u0435\u043B\u044C\u043D\u0438\u0445 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432 (\u0433\u0456\u043F\u0441\u043E\u0432\u0456, \u0446\u0435\u043C\u0435\u043D\u0442\u043D\u0456, \u0446\u0435\u0433\u0435\u043B\u044C\u043D\u0456, \u0447\u0435\u0440\u0435\u043F\u0438\u0447\u043D\u0456 \u0437\u0430\u0432\u043E\u0434\u0438 \u0442\u0430 \u0442. \u0456\u043D.)"
'2301.8': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043B\u0456\u0441\u043E\u0437\u0430\u0433\u043E\u0442\u0456\u0432\u0435\u043B\u044C\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456"
'2301.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0433\u0456\u0440\u043D\u0438\u0447\u043E\u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0438\u0445 \u0442\u0430 \u0434\u043E\u0431\u0443\u0432\u043D\u0438\u0445 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0456\u043D\u0448\u0456"
'2302': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0435\u043D\u0435\u0440\u0433\u0435\u0442\u0438\u043A\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0433\u0456\u0434\u0440\u0430\u0432\u043B\u0456\u0447\u043D\u0456 \u0430\u0431\u043E \u0442\u0435\u043F\u043B\u043E\u0432\u0456 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0442\u0430 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 \u0434\u043B\u044F \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0435\u043D\u0435\u0440\u0433\u0456\u0457, \u043D\u0430\u043F\u0440\u0438\u043A\u043B\u0430\u0434, \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0456\u0457, \u0449\u043E \u043F\u0440\u0430\u0446\u044E\u044E\u0442\u044C \u043D\u0430 \u0432\u0443\u0433\u0456\u043B\u043B\u0456, \u0430\u0442\u043E\u043C\u043D\u0456 \u0442\u0430 \u0432\u0456\u0442\u0440\u043E\u0432\u0456 \u0435\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0456\u0457.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432\u0430 \u0437\u0456 \u0437\u0431\u0430\u0433\u0430\u0447\u0435\u043D\u043D\u044F \u0442\u0430 \u043F\u0435\u0440\u0435\u0440\u043E\u0431\u043B\u0435\u043D\u043D\u044F \u044F\u0434\u0435\u0440\u043D\u0438\u0445 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432\u043F\u0435\u0447\u0456 \u0434\u043B\u044F \u0441\u043F\u0430\u043B\u044E\u0432\u0430\u043D\u043D\u044F \u0432\u0456\u0434\u0445\u043E\u0434\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0434\u0430\u043C\u0431\u0438 (21.52)\u0435\u043B\u0435\u043A\u0442\u0440\u043E\u043B\u0456\u043D\u0456\u0457, \u0432\u043A\u043B\u044E\u0447\u0430\u044E\u0447\u0438 \u0442\u0440\u0430\u043D\u0441\u043E\u0440\u043C\u0430\u0442\u043E\u0440\u043D\u0456 \u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0442\u0430 \u043F\u0456\u0434\u0441\u0442\u0430\u043D\u0446\u0456\u0457 (22.14)"
'2302.1': "\u0415\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0433\u0456\u0434\u0440\u0430\u0432\u043B\u0456\u0447\u043D\u0456 \u0442\u0430 \u0433\u0456\u0434\u0440\u043E\u0430\u043A\u0443\u043C\u0443\u043B\u044F\u0446\u0456\u0439\u043D\u0456"
'2302.2': "\u0415\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0442\u0435\u043F\u043B\u043E\u0432\u0456"
'2302.3': "\u0415\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u0430\u0442\u043E\u043C\u043D\u0456"
'2302.4': "\u0415\u043B\u0435\u043A\u0442\u0440\u043E\u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u043D\u0430 \u043D\u0435\u0442\u0440\u0430\u0434\u0438\u0446\u0456\u0439\u043D\u0438\u0445 \u0434\u0436\u0435\u0440\u0435\u043B\u0430\u0445 \u0435\u043D\u0435\u0440\u0433\u0456\u0457"
'2302.5': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0437\u0456 \u0437\u0431\u0430\u0433\u0430\u0447\u0435\u043D\u043D\u044F \u0442\u0430 \u043F\u0435\u0440\u0435\u0440\u043E\u0431\u043B\u0435\u043D\u043D\u044F \u044F\u0434\u0435\u0440\u043D\u0438\u0445 \u043C\u0430\u0442\u0435\u0440\u0456\u0430\u043B\u0456\u0432"
'2302.6': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0437\u0456 \u0441\u043F\u0430\u043B\u044E\u0432\u0430\u043D\u043D\u044F \u0432\u0456\u0434\u0445\u043E\u0434\u0456\u0432"
'2302.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0435\u043B\u0435\u043A\u0442\u0440\u043E- \u0442\u0430 \u0442\u0435\u043F\u043B\u043E\u0435\u043D\u0435\u0440\u0433\u0435\u0442\u0438\u043A\u0438 \u0456\u043D\u0448\u0456"
'2303': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0445\u0456\u043C\u0456\u0447\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438, \u0449\u043E \u0443\u0442\u0432\u043E\u0440\u044E\u044E\u0442\u044C \u0445\u0456\u043C\u0456\u0447\u043D\u0456, \u043D\u0430\u0444\u0442\u043E\u0445\u0456\u043C\u0456\u0447\u043D\u0456 \u0430\u0431\u043E \u043D\u0430\u0444\u0442\u043E\u043F\u0435\u0440\u0435\u0440\u043E\u0431\u043D\u0456 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432\u0430.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u043F\u043E\u0440\u0442\u043E\u0432\u0456 \u0442\u0435\u0440\u043C\u0456\u043D\u0430\u043B\u0438 \u0434\u043B\u044F \u043D\u0430\u0444\u0442\u043E\u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432\u043A\u043E\u043A\u0441\u043E\u0445\u0456\u043C\u0456\u0447\u043D\u0456 \u0437\u0430\u0432\u043E\u0434\u0438"
'2303.1': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0441\u043E\u0434\u043E\u0432\u043E\u0457, \u0445\u043B\u043E\u0440\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456 \u0442\u0430 \u0437 \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430 \u043F\u043B\u0430\u0441\u0442\u0438\u0447\u043D\u0438\u0445 \u043C\u0430\u0441"
'2303.2': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043B\u0430\u043A\u043E\u0444\u0430\u0440\u0431\u043E\u0432\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456 \u0442\u0430 \u043F\u043E\u0431\u0443\u0442\u043E\u0432\u043E\u0457 \u0445\u0456\u043C\u0456\u0457"
'2303.3': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043D\u0430\u0444\u0442\u043E\u0445\u0456\u043C\u0456\u0447\u043D\u0438\u0445 \u0442\u0430 \u043D\u0430\u0444\u0442\u043E\u043F\u0435\u0440\u0435\u0440\u043E\u0431\u043D\u0438\u0445 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432"
'2303.4': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043A\u043E\u043A\u0441\u043E\u0445\u0456\u043C\u0456\u0447\u043D\u0438\u0445 \u0437\u0430\u0432\u043E\u0434\u0456\u0432"
'2303.5': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0437 \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430 \u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 \u043E\u0441\u043D\u043E\u0432\u043D\u043E\u0433\u043E \u043E\u0440\u0433\u0430\u043D\u0456\u0447\u043D\u043E\u0433\u043E \u0441\u0438\u043D\u0442\u0435\u0437\u0443 \u0442\u0430 \u0441\u0438\u043D\u0442\u0435\u0442\u0438\u0447\u043D\u043E\u0433\u043E \u043A\u0430\u0443\u0447\u0443\u043A\u0443"
'2303.6': "\u0422\u0435\u0440\u043C\u0456\u043D\u0430\u043B\u0438 \u0434\u043B\u044F \u043D\u0430\u0444\u0442\u043E\u043F\u0440\u043E\u0434\u0443\u043A\u0442\u0456\u0432 \u043F\u043E\u0440\u0442\u043E\u0432\u0456 \u0442\u0430 \u043F\u0440\u0438\u0431\u0435\u0440\u0435\u0436\u043D\u0456"
'2303.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u0445\u0456\u043C\u0456\u0447\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456 \u0456\u043D\u0448\u0456"
'2304': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u0439\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456, \u043D\u0435 \u043A\u043B\u0430\u0441\u0438\u0444\u0456\u043A\u043E\u0432\u0430\u043D\u0456 \u0440\u0430\u043D\u0456\u0448\u0435.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438, \u0449\u043E \u0443\u0442\u0432\u043E\u0440\u044E\u044E\u0442\u044C \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432\u0430 \u043C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u0439\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456, \u0442\u0430\u043A\u0456 \u044F\u043A \u0434\u043E\u043C\u0435\u043D\u043D\u0456 \u043F\u0435\u0447\u0456, \u043F\u0440\u043E\u043A\u0430\u0442\u043D\u0456 \u0441\u0442\u0430\u043D\u0438, \u043B\u0438\u0432\u0430\u0440\u043D\u0456 \u0446\u0435\u0445\u0438 \u0442\u0430 \u0442. \u0456\u043D"
'2304.1': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0430\u0433\u043B\u043E\u043C\u0435\u0440\u0430\u0446\u0456\u0439\u043D\u043E\u0433\u043E \u0442\u0430 \u0434\u043E\u043C\u0435\u043D\u043D\u043E\u0433\u043E \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430"
'2304.2': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0441\u0442\u0430\u043B\u0435\u043F\u043B\u0430\u0432\u0438\u043B\u044C\u043D\u043E\u0433\u043E \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430"
'2304.3': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0440\u043E\u043A\u0430\u0442\u043D\u043E\u0433\u043E \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430"
'2304.4': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0442\u0440\u0443\u0431\u043D\u043E\u0433\u043E \u0442\u0430 \u043C\u0435\u0442\u0438\u0437\u043D\u043E\u0433\u043E \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430"
'2304.5': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0444\u0435\u0440\u043E\u0441\u043F\u043B\u0430\u0432\u043D\u043E\u0433\u043E \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430"
'2304.6': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0432\u043E\u0433\u043D\u0435\u0442\u0440\u0438\u0432\u043A\u043E\u0433\u043E \u0432\u0438\u0440\u043E\u0431\u043D\u0438\u0446\u0442\u0432\u0430"
'2304.7': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043A\u043E\u043B\u044C\u043E\u0440\u043E\u0432\u043E\u0457 \u043C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u0457"
'2304.9': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434\u043F\u0440\u0438\u0454\u043C\u0441\u0442\u0432 \u043C\u0435\u0442\u0430\u043B\u0443\u0440\u0433\u0456\u0439\u043D\u043E\u0457 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u043E\u0441\u0442\u0456 \u0456\u043D\u0448\u0456"
'24': "\u0406\u043D\u0448\u0456 \u0456\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438"
'241': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u043E\u0433\u043E \u0442\u0430 \u0440\u043E\u0437\u0432\u0430\u0436\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F"
'2411': "\u0421\u0442\u0430\u0434\u0456\u043E\u043D\u0438, \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u0456 \u043F\u043E\u043B\u044F \u0442\u0430 \u043C\u0430\u0439\u0434\u0430\u043D\u0447\u0438\u043A\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0430\u0454:\u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u0456 \u043C\u0430\u0439\u0434\u0430\u043D\u0447\u0438\u043A\u0438, \u043E\u0431\u043B\u0430\u0434\u043D\u0430\u043D\u0456 \u0434\u043B\u044F \u0437\u0430\u043D\u044F\u0442\u044C \u0441\u043F\u043E\u0440\u0442\u043E\u043C \u043D\u0430 \u0432\u0456\u0434\u043A\u0440\u0438\u0442\u043E\u043C\u0443 \u043F\u043E\u0432\u0456\u0442\u0440\u0456, \u0442\u0430\u043A\u0438\u043C\u0438 \u044F\u043A \u0444\u0443\u0442\u0431\u043E\u043B, \u0431\u0435\u0439\u0441\u0431\u043E\u043B, \u0440\u0435\u0433\u0431\u0456, \u0432\u043E\u0434\u043D\u0438\u0439 \u0441\u043F\u043E\u0440\u0442 \u0442\u043E\u0449\u043E \u0442\u0440\u0435\u043A\u0438 \u0442\u0430 \u043F\u043E\u043B\u044F \u0434\u043B\u044F \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u043E\u0433\u043E, \u0432\u0435\u043B\u043E\u0441\u0438\u043F\u0435\u0434\u043D\u043E\u0433\u043E \u0442\u0430 \u043A\u0456\u043D\u043D\u043E\u0433\u043E \u0441\u043F\u043E\u0440\u0442\u0443.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0437\u0430\u043B\u0438 \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u0456 (12.65)\u0456\u0433\u0440\u043E\u0432\u0456 \u043C\u0430\u0439\u0434\u0430\u043D\u0447\u0438\u043A\u0438, \u043F\u0430\u0440\u043A\u0438 \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443 \u0442\u0430 \u0440\u043E\u0437\u0432\u0430\u0433, \u043C\u0430\u0439\u0434\u0430\u043D\u0447\u0438\u043A\u0438 \u0434\u043B\u044F \u0433\u0440\u0438 \u0432 \u0433\u043E\u043B\u044C\u0444, \u043F\u0440\u0438\u0447\u0430\u043B\u044C\u043D\u0456 \u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u044F\u0445\u0442\u0441\u043C\u0435\u043D\u0456\u0432 (24.12)"
'2411.1': "\u0421\u0442\u0430\u0434\u0456\u043E\u043D\u0438 \u0442\u0430 \u043C\u0430\u0439\u0434\u0430\u043D\u0447\u0438\u043A\u0438 \u0434\u043B\u044F \u0437\u0430\u043D\u044F\u0442\u044C \u0441\u043F\u043E\u0440\u0442\u043E\u043C \u043D\u0430 \u0432\u0456\u0434\u043A\u0440\u0438\u0442\u043E\u043C\u0443 \u043F\u043E\u0432\u0456\u0442\u0440\u0456"
'2411.2': "\u0422\u0440\u0435\u043A\u0438 \u0442\u0430 \u043F\u043E\u043B\u044F \u0434\u043B\u044F \u0430\u0432\u0442\u043E\u043C\u043E\u0431\u0456\u043B\u044C\u043D\u043E\u0433\u043E, \u0432\u0435\u043B\u043E\u0441\u0438\u043F\u0435\u0434\u043D\u043E\u0433\u043E \u0442\u0430 \u043A\u0456\u043D\u043D\u043E\u0433\u043E \u0441\u043F\u043E\u0440\u0442\u0443"
'2411.3': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0434\u043B\u044F \u0437\u0430\u043D\u044F\u0442\u044C \u0432\u043E\u0434\u043D\u0438\u043C \u0441\u043F\u043E\u0440\u0442\u043E\u043C"
'2412': "\u0406\u043D\u0448\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u043E\u0433\u043E \u0442\u0430 \u0440\u043E\u0437\u0432\u0430\u0436\u0430\u043B\u044C\u043D\u043E\u0433\u043E \u043F\u0440\u0438\u0437\u043D\u0430\u0447\u0435\u043D\u043D\u044F.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u043F\u0430\u0440\u043A\u0438 \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443 \u0456 \u0440\u043E\u0437\u0432\u0430\u0433 \u0442\u0430 \u0456\u043D\u0448\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u0456\u0434 \u0432\u0456\u0434\u043A\u0440\u0438\u0442\u0438\u043C \u043D\u0435\u0431\u043E\u043C, \u0432\u043A\u043B\u044E\u0447\u0430\u044E\u0447\u0438 \u0443\u0441\u0442\u0430\u043D\u043E\u0432\u043A\u0438 \u0434\u043B\u044F \u0441\u0445\u043E\u0434\u0436\u0435\u043D\u043D\u044F (\u043B\u0438\u0436\u043D\u0456 \u0442\u0440\u043E\u043F\u0438 \u0442\u043E\u0449\u043E), \u043C\u0430\u0439\u0434\u0430\u043D\u0447\u0438\u043A\u0438 \u0434\u043B\u044F \u0433\u0440\u0438 \u0432 \u0433\u043E\u043B\u044C\u0444, \u043B\u044C\u043E\u0442\u043D\u0456 \u043F\u043E\u043B\u044F, \u043A\u0456\u043D\u043D\u0456 \u0446\u0435\u043D\u0442\u0440\u0438, \u043F\u0440\u0438\u0447\u0430\u043B\u044C\u043D\u0456 \u043F\u0440\u0438\u0441\u0442\u0440\u043E\u0457 \u0434\u043B\u044F \u044F\u0445\u0442\u0441\u043C\u0435\u043D\u0456\u0432, \u0441\u043F\u043E\u0440\u0443\u0434\u0438, \u0449\u043E \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F \u0433\u043E\u043B\u043E\u0432\u043D\u0438\u043C \u0447\u0438\u043D\u043E\u043C \u0434\u043B\u044F \u043C\u043E\u0440\u0435\u043F\u043B\u0430\u0432\u043D\u043E\u0433\u043E \u0441\u043F\u043E\u0440\u0442\u0443 \u0442\u0430 \u043F\u043B\u044F\u0436\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0433\u0440\u043E\u043C\u0430\u0434\u0441\u044C\u043A\u0456 \u0441\u0430\u0434\u0438 \u0456 \u043F\u0430\u0440\u043A\u0438, \u0437\u043E\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0456 \u0442\u0430 \u0431\u043E\u0442\u0430\u043D\u0456\u0447\u043D\u0456 \u0441\u0430\u0434\u0438.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0433\u0456\u0440\u0441\u044C\u043A\u0456 \u043F\u0440\u0438\u0442\u0443\u043B\u043A\u0438 (12.12)\u0441\u0442\u0430\u043D\u0446\u0456\u0457 \u043F\u0456\u0434\
  \u0432\u0456\u0441\u043D\u0438\u0445 \u0442\u0430 \u043A\u0430\u043D\u0430\u0442\u043D\u0438\u0445 \u0434\u043E\u0440\u0456\u0433 (12.41)\u0431\u0443\u0434\u0456\u0432\u043B\u0456, \u0449\u043E \u0432\u0438\u043A\u043E\u0440\u0438\u0441\u0442\u043E\u0432\u0443\u044E\u0442\u044C\u0441\u044F \u0434\u043B\u044F \u043F\u0443\u0431\u043B\u0456\u0447\u043D\u0438\u0445 \u0432\u0438\u0441\u0442\u0443\u043F\u0456\u0432 (12.61)\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0437\u043E\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0438\u0445 \u0442\u0430 \u0431\u043E\u0442\u0430\u043D\u0456\u0447\u043D\u0438\u0445 \u0441\u0430\u0434\u0456\u0432 (12.62)\u0437\u0430\u043B\u0438 \u0441\u043F\u043E\u0440\u0442\u0438\u0432\u043D\u0456 (12.65)"
'2412.1': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0434\u043B\u044F \u043C\u043E\u0440\u0435\u043F\u043B\u0430\u0432\u043D\u0438\u0445 \u0432\u0438\u0434\u0456\u0432 \u0441\u043F\u043E\u0440\u0442\u0443 \u0442\u0430 \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443"
'2412.2': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0434\u043B\u044F \u0437\u0438\u043C\u043E\u0432\u0438\u0445 \u0442\u0430 \u0433\u0456\u0440\u0441\u044C\u043A\u0438\u0445 \u0432\u0438\u0434\u0456\u0432 \u0441\u043F\u043E\u0440\u0442\u0443 \u0442\u0430 \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443"
'2412.3': "\u041B\u044C\u043E\u0442\u043D\u0456 \u043F\u043E\u043B\u044F \u0442\u0430 \u043F\u043E\u043B\u044F \u0434\u043B\u044F \u043F\u0430\u0440\u0430\u0448\u0443\u0442\u043D\u043E\u0433\u043E \u0441\u043F\u043E\u0440\u0442\u0443"
'2412.4': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043A\u0456\u043D\u043D\u0438\u0445 \u0446\u0435\u043D\u0442\u0440\u0456\u0432"
'2412.5': "\u0413\u0440\u043E\u043C\u0430\u0434\u0441\u044C\u043A\u0456 \u0441\u0430\u0434\u0438 \u0442\u0430 \u043F\u0430\u0440\u043A\u0438 \u0434\u043B\u044F \u0440\u043E\u0437\u0432\u0430\u0433 \u0456 \u0432\u0456\u0434\u043F\u043E\u0447\u0438\u043D\u043A\u0443"
'2412.6': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u0437\u043E\u043E\u043B\u043E\u0433\u0456\u0447\u043D\u0438\u0445 \u0442\u0430 \u0431\u043E\u0442\u0430\u043D\u0456\u0447\u043D\u0438\u0445 \u0441\u0430\u0434\u0456\u0432"
'2412.7': "\u041C\u0430\u0439\u0434\u0430\u043D\u0447\u0438\u043A\u0438 \u0434\u043B\u044F \u0433\u0440\u0438 \u0432 \u0433\u043E\u043B\u044C\u0444"
'242': "\u0406\u043D\u0448\u0456 \u0456\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438, \u043D\u0435 \u043A\u043B\u0430\u0441\u0438\u0444\u0456\u043A\u043E\u0432\u0430\u043D\u0456 \u0440\u0430\u043D\u0456\u0448\u0435"
'2420': "\u0406\u043D\u0448\u0456 \u0456\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438, \u043D\u0435 \u043A\u043B\u0430\u0441\u0438\u0444\u0456\u043A\u043E\u0432\u0430\u043D\u0456 \u0440\u0430\u043D\u0456\u0448\u0435.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0456 \u0456\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438, \u043D\u0430\u043F\u0440\u0438\u043A\u043B\u0430\u0434, \u0444\u043E\u0440\u0442\u0438, \u0431\u043B\u043E\u043A\u0433\u0430\u0443\u0437\u0438, \u0431\u0443\u043D\u043A\u0435\u0440\u0438, \u0441\u0442\u0440\u0456\u043B\u044C\u0431\u0438\u0449\u0430, \u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0456 \u0432\u0438\u043F\u0440\u043E\u0431\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u0446\u0435\u043D\u0442\u0440\u0438 \u0442\u043E\u0449\u043E\u0456\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438, \u043D\u0435 \u043A\u043B\u0430\u0441\u0438\u0444\u0456\u043A\u043E\u0432\u0430\u043D\u0456 \u0440\u0430\u043D\u0456\u0448\u0435, \u0432\u043A\u043B\u044E\u0447\u0430\u044E\u0447\u0438 \u0434\u0456\u043B\u044F\u043D\u043A\u0438 \u0434\u043B\u044F \u0437\u0430\u043F\u0443\u0441\u043A\u0443 \u0441\u0443\u043F\u0443\u0442\u043D\u0438\u043A\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u0432\u043A\u043B\u044E\u0447\u0430\u0454 \u0442\u0430\u043A\u043E\u0436:\u0432\u0456\u0434\u0432\u0430\u043B\u0438 \u0433\u0456\u0440\u043D\u0438\u0447\u043D\u0438\u0445 \u0440\u043E\u0437\u0440\u043E\u0431\u043E\u043A\u043F\u043E\u043B\u0456\u0433\u043E\u043D\u0438 \u0441\u043A\u043B\u0430\u0434\u0443\u0432\u0430\u043D\u043D\u044F \u043F\u043E\u0431\u0443\u0442\u043E\u0432\u0438\u0445 \u0432\u0456\u0434\u0445\u043E\u0434\u0456\u0432.\u0426\u0435\u0439 \u043A\u043B\u0430\u0441 \u043D\u0435 \u0432\u043A\u043B\u044E\u0447\u0430\u0454:\u0431\u0443\u0434\u0456\u0432\u043B\u0456 \u0430\u0435\u0440\u043E\u043F\u043E\u0440\u0442\u0456\u0432 (12.41)\u043A\u0430\u0437\u0430\u0440\u043C\u0438 (12.74)\u0432\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0456 \u043F\u043E\u0440\u0442\u0438 (21.51)"
'2420.1': "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0456 \u0432\u0438\u043F\u0440\u043E\u0431\u0443\u0432\u0430\u043B\u044C\u043D\u0456 \u0446\u0435\u043D\u0442\u0440\u0438"
'2420.2': "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0456 \u043F\u043E\u043B\u0456\u0433\u043E\u043D\u0438 \u0442\u0430 \u0441\u0442\u0440\u0456\u043B\u044C\u0431\u0438\u0449\u0430"
'2420.3': "\u0412\u0456\u0439\u0441\u044C\u043A\u043E\u0432\u0456 \u0456\u043D\u0436\u0435\u043D\u0435\u0440\u043D\u0456 \u0444\u043E\u0440\u0442\u0438\u0444\u0456\u043A\u0430\u0446\u0456\u0439\u043D\u0456 \u0441\u043F\u043E\u0440\u0443\u0434\u0438"
'2420.4': "\u041A\u043E\u0441\u043C\u043E\u0434\u0440\u043E\u043C\u0438 \u0442\u0430 \u0434\u0456\u043B\u044C\u043D\u0438\u0446\u0456 \u0434\u043B\u044F \u0437\u0430\u043F\u0443\u0441\u043A\u0443 \u0441\u0443\u043F\u0443\u0442\u043D\u0438\u043A\u0456\u0432"
'2420.5': "\u041F\u043E\u043B\u0456\u0433\u043E\u043D\u0438 \u0441\u043A\u043B\u0430\u0434\u0443\u0432\u0430\u043D\u043D\u044F \u043F\u043E\u0431\u0443\u0442\u043E\u0432\u0438\u0445 \u0432\u0456\u0434\u0445\u043E\u0434\u0456\u0432"
'2420.6': "\u0421\u043F\u043E\u0440\u0443\u0434\u0438 \u043F\u043E \u0437\u043D\u0435\u0448\u043A\u043E\u0434\u0436\u0435\u043D\u043D\u044E \u0442\u0430 \u0437\u0430\u0445\u043E\u0440\u043E\u043D\u0435\u043D\u043D\u044E \u0448\u043A\u0456\u0434\u043B\u0438\u0432\u0438\u0445 \u043F\u0440\u043E\u043C\u0438\u0441\u043B\u043E\u0432\u0438\u0445 \u0432\u0456\u0434\u0445\u043E\u0434\u0456\u0432"
'2420.7': "\u0412\u0456\u0434\u0432\u0430\u043B\u0438 \u0433\u0456\u0440\u043D\u0438\u0447\u0438\u0445 \u0440\u043E\u0437\u0440\u043E\u0431\u043E\u043A"
